/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`%`*/ /*!50003 TRIGGER `cachesBeforeDelete` BEFORE DELETE ON `caches`
     FOR EACH ROW BEGIN
        IF IFNULL(@allowdelete,0) = 0 THEN
            CALL error_set_allowdelete_to_delete_caches();
            
