/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`%`*/ /*!50003 TRIGGER `picturesBeforeUpdate` BEFORE UPDATE ON `pictures`
     FOR EACH ROW BEGIN
        
        IF ISNULL(@XMLSYNC) OR @XMLSYNC!=1 THEN
