rden i.d.R. wird diese Überprüfung innerhalb von 24 bis \r\n						48 Stunden durchgeführt. Der Newseintrag kann nach der Bestätigung nicht mehr verändert werden. Sollten Änderungen notwendig \r\n						sein, bitte die korrigierte Nachricht einfach nochmals eingeben. Erlaubt sind Newseinträge zu allen Themen rund um\'s Geocaching.\r\n						Nicht erlaubt ist direkte Werbung für\r\n						Produkte oder einen Geocache. Die Freischaltung eines Newseintrags für die Anzeige auf der Webseite liegt ausschließlich im\r\n						Ermessen des Betreibers der Webseite - es besteht kein Anspruch auf eine Veröffentlichung. Im Zweifelsfall bitte den Newseintrag\r\n						melden und abwarten, ob er veröffentlicht wird, oder per E-Mail an <a href=\"mailto:%1\">%1</a>\r\n						vorher erkundigen.','2010-08-28 11:48:06'),(474,'DE','Sollte das Problem längere Zeit bestehen, wende dich bitte an <a href=\"mailto:%1\">%1</a>.','2020-12-16 17:43:31'),(475,'DE','%1 ist momentan außer Betrieb','2020-12-16 17:43:31'),(477,'DE','Gesamt:','2020-12-16 17:43:31'),(478,'DE','Businesslayer:','2020-12-16 17:43:31'),(479,'DE','Framework:','2020-12-16 17:43:31'),(480,'DE','Benutzer:','2020-12-16 17:43:31'),(481,'DE','SQL-Debugger','2020-12-16 17:43:31'),(482,'DE','%1 Befehle','2020-12-16 17:43:31'),(483,'DE','Übersicht','2020-12-16 17:43:31'),(484,'DE','Profildaten','2020-12-16 17:43:31'),(485,'DE','Gespeicherte Suchen','2020-12-16 17:43:31'),(486,'DE','Beobachtete Caches','2020-12-16 17:43:31'),(487,'DE','Ignorierte Caches','2020-12-16 17:43:31'),(488,'DE','Einstellungen','2020-12-16 17:43:31'),(490,'DE','Der Radius darf maximal 150 km betragen. Zum Deaktivieren der Benachrichtigung setze den Umkreis auf den Wert 0.','2020-12-16 17:43:31'),(491,'DE','Passwort ändern','2020-12-16 17:43:31'),(493,'DE','E-Mail-Adresse','2020-12-16 17:43:31'),(496,'DE','archiviert','2020-12-16 17:43:31'),(497,'DE','nicht gefunden','2020-12-16 17:43:31'),(498,'DE','teilgenommen','2020-12-16 17:43:31'),(499,'DE','möchte teilnehmen