rt etwas eingeben!','2020-12-16 17:43:42'),(1504,'DE','Bitte im Feld für Besitzer etwas eingeben!','2020-12-16 17:43:42'),(1505,'DE','Bitte im Feld für Finder etwas eingeben!','2020-12-16 17:43:42'),(1506,'DE','auch bei GC.com veröffentlichte','2020-12-16 17:43:42'),(1507,'DE','Das ausgewählte Ausgabeformat existiert nicht!','2020-12-16 17:43:42'),(1508,'DE','Die Suchanfrage konnte nicht ausgeführt werden; bitte gib die Suchdaten erneut ein.','2020-12-16 17:43:42'),(1509,'DE','Gefunden','2020-12-16 17:43:42'),(1512,'DE','Die Postleitzahl wurde nicht gefunden.','2020-12-16 17:43:42'),(1513,'DE','Es wurde kein Ort mit diesem Namen gefunden.','2020-12-16 17:43:42'),(1514,'DE','Für den ausgewählten Ort sind keine Koordinaten vorhanden.','2020-12-16 17:43:42'),(1516,'DE','Der eingegebene Text ist ungültig.','2020-12-16 17:43:42'),(1517,'DE','Der eingegebene Text enthält mehr als 50 Wörter.','2020-12-16 17:43:42'),(1518,'DE','Alle Länder','2020-12-16 17:43:42'),(1521,'DE','Dieser Cache wurde auf einem anderen Opencaching-Webserver erstellt und kann nur auf diesem bearbeitet werden.','2020-12-16 17:43:42'),(1522,'DE','Optionen speichern','2020-12-16 17:43:42'),(1523,'DE','Optionen bearbeiten','2020-12-16 17:43:42'),(1524,'DE','Typ','2020-12-16 17:43:42'),(1525,'DE','Letzte Logs','2020-12-16 17:43:42'),(1526,'DE','Downloads','2020-12-16 17:43:42'),(1527,'DE','Einträge auf dieser Seite:','2020-12-16 17:43:42'),(1529,'DE','Mit dem Download werden die <a href=\"articles.php?page=impressum#tos\">Nutzungsbedingungen</a> von Opencaching.de akzeptiert.&nbsp;&nbsp;','2020-12-16 17:43:42'),(1530,'DE','Dieser Logeintrag wurde auf einem anderen Opencaching-Webserver erstellt und kann nur auf diesem bearbeitet werden.','2020-12-16 17:43:42'),(1531,'DE','Diese Beschreibung wurde auf einem anderen Opencaching-Webserver erstellt und kann nur auf diesem bearbeitet werden.','2020-12-16 17:43:42'),(1532,'DE','Der Besitzer des Caches hat dir folgende Bemerkung geschrieben:','2020-12-16 17:43:42'),(1533,'DE','Cachegröße für Virtual oder Webcam muß \'kein Behälter\' sein!','2020-12-16 17:43:42'),(1537,'DE','Dein HTML-Code wird nochmals durch einen speziellen Filter verändert. Dies ist notwendig um gefährliche HTML-Tages wie z.B. &lt;script&gt; zu filtern. Eine Liste mit erlaubten HTML-Tags findest du <a href=\"articles.php?page=htmltags\">hier</a>.','2020-12-16 17:43:42'),(1538,'DE','Sprache:','2020-12-16 17:43:42'),(1539,'DE','Nicht gefunden','2020-12-16 17:43:42'),(1541,'DE','nur bei Nacht','2020-12-16 17:43:42'),(1542,'DE','nur Hyperlink zu OC-externen Portalen','2020-12-16 17:43:42'),(1543,'DE','Letterbox (benötigt Stempel)','2020-12-16 17:43:42'),(1544,'DE','gefährliches Gebiet','2020-12-16 17:43:42'),(1545,'DE','Der Geocache kann nur bei Nacht gel&ouml;st werden und wird deshalb Nachtcache genannt. Zum Beispiel m&uuml;ssen Reflektoren mit einer Taschenlampe angeleuchtet werden, die dann den Weg zum Versteck zeigen. Bitte ggf. auch das Attribut &quot;Taschenlampe&quot; setzen.','2020-12-16 17:43:42'),(1546,'DE','Der Geocache ist nur bei Opencaching gelistet. Benutzer von anderen Geocache-Datenbanken haben so einen schnellen &Uuml;berblick, welche Geocaches es sich lohnt n&auml;her anzusehen.','2020-12-16 17:43:42'),(1548,'DE','In dem Beh&auml;lter vor Ort befindet sich ein Stempel, mit dem man sein pers&ouml;nliches Logbuch abstempeln kann. Das Logbuch im Geocache wird ebenfalls mit einem pers&ouml;nlichen Stempel signiert. Bitte achte unbedingt darauf, dass du den Stempel aus dem Geocache nicht mitnimmst oder tauschst! Die Aufgaben bei Letterboxen sind h&auml;ufig so gestaltet, dass man den Geocache auch ohne GPS-Ger&auml;t finden kann - wie bei einer klassichen Schnitzeljagd. Dann bitte auch das Attribut &quot;ohne GPS&quot; angeben.','2020-12-16 17:43:42'),(1549,'DE','In dem Gebiet, wo der Geocache versteckt wurde, ist mit Gefahren zu rechnen. Mit diesem Attribut kann man auch auf Gefahren aufmerksam machen, die nicht auf den ersten Blick offensichtlich sind. Das k&ouml;nnen z.B. stark befahrene Stra&szlig;en, steile Abh&auml;nge oder Steinschlag sein. Deshalb sollte man bei Geocaching-Touren mit Kindern oder gr&ouml;&szlig;eren Gruppen entsprechende Vorsichtsma&szlig;nahmen ergreifen und je nachdem auch auf die Witterung achten (z.B. Regen bei steilen Abh&auml;ngen). N&auml;heres zu den Gefahren ist in der Cachebeschreibung erl&auml;utert.','2020-12-16 17:43:42'),(1550,'DE','aktive Eisenbahnlinie in der Nähe','2020-12-16 17:43:42'),(1551,'DE','Klippen / Felsen','2020-12-16 17:43:42'),(1552,'DE','Jagdgebiet','2020-12-16 17:43:42'),(1553,'DE','Dornen','2020-12-16 17:43:42'),(1554,'DE','Zecken','2020-12-16 17:43:42'),(1555,'DE','Folgen des Bergbaus','2020-12-16 17:43:42'),(1556,'DE','giftige Pflanzen','2020-12-16 17:43:42'),(1557,'DE','giftige/gefährliche Tiere','2020-12-16 17:43:42'),(1558,'DE','Parkplatz in der Nähe','2020-12-16 17:43:42'),(1559,'DE','erreichbar mit ÖVM','2020-12-16 17:43:42'),(1560,'DE','Trinkwasser in der Nähe','2020-12-16 17:43:42'),(1561,'DE','öffentliche Toilette in der Nähe','2020-12-16 17:43:42'),(1562,'DE','Telefon in der Nähe','2020-12-16 17:43:42'),(1563,'DE','Erste Hilfe verfügbar','2020-12-16 17:43:43'),(1564,'DE','nahe beim Auto','2020-12-16 17:43:43'),(1565,'DE','längere Wanderung','2020-12-16 17:43:43'),(1566,'DE','sumpfiges/matschiges Gelände / waten','2020-12-16 17:43:43'),(1567,'DE','hügeliges Gelände','2020-12-16 17:43:43'),(1568,'DE','leichtes Klettern (ohne Ausrüstung)','2020-12-16 17:43:43'),(1569,'DE','Schwimmen erforderlich','2020-12-16 17:43:43'),(1570,'DE','interessanter Ort','2020-12-16 17:43:43'),(1571,'DE','bewegliches Ziel','2020-12-16 17:43:43'),(1572,'DE','Webcam am Ziel','2020-12-16 17:43:43'),(1573,'DE','in geschlossenen Räumen (Höhle, Gebäude, etc.)','2020-12-16 17:43:43'),(1575,'DE','ohne GPS (Letterboxen, Cistes, compass-juggling,...)','2020-12-16 17:43:43'),(1576,'DE','Zugangs- bzw. Parkentgelt','2020-12-16 17:43:43'),(1577,'DE','Übernachtung erforderlich','2020-12-16 17:43:43'),(1578,'DE','rund um die Uhr machbar','2020-12-16 17:43:43'),(1579,'DE','nur zu bestimmten Uhrzeiten','2020-12-16 17:43:43'),(1580,'DE','nur tagsüber','2020-12-16 17:43:43'),(1581,'DE','nicht bei Hochwasser oder Flut','2020-12-16 17:43:43'),(1582,'DE','ganzjährig zugänglich','2020-12-16 17:43:43'),(1583,'DE','Brutsaison / Naturschutz','2020-12-16 17:43:43'),(1584,'DE','schneesicheres Versteck','2020-12-16 17:43:43'),(1585,'DE','spezielle Ausrüstung','2020-12-16 17:43:43'),(1586,'DE','Kompass','2020-12-16 17:43:43'),(1587,'DE','Taschenlampe','2020-12-16 17:43:43'),(1588,'DE','Kletterzeug','2020-12-16 17:43:43'),(1589,'DE','Höhlenzeug','2020-12-16 17:43:43'),(1590,'DE','Taucherausrüstung','2020-12-16 17:43:43'),(1591,'DE','Wasserfahrzeug','2020-12-16 17:43:43'),(1592,'DE','Fluggerät','2020-12-16 17:43:43'),(1593,'DE','Recherche','2020-12-16 17:43:43'),(1594,'DE','Rätsel','2020-12-16 17:43:43'),(1595,'DE','Rechenaufgabe','2020-12-16 17:43:43'),(1596,'DE','sonstiger Cachetyp','2020-12-16 17:43:43'),(1597,'DE','Startbedingungen beim Owner erfragen','2020-12-16 17:43:43'),(1598,'DE','kindgerecht','2020-12-16 17:43:43'),(1599,'DE','In der N&auml;he dieses Caches gibt es genutzte Eisenbahnlinien. Bitte seid entsprechend vorsichtig und achtet darauf, abseits von Bahn&uuml;berg&auml;ngen keine Gleise zu betreten.','2020-12-16 17:43:43'),(1600,'DE','In der N&auml;he des Caches gibt es Klippen oder Felsen. Unterhalb von Felsen sollte man auf Steinschlag achten, von der Oberseite der Klippen sollte man sich entsprechend vorsichtig n&auml;hern (insbesondere mit Kindern oder Mountainbikes). Besonders gef&auml;hrlich - und nicht immer erkennbar - ist es, sich &uuml;ber einen Steilhang von oben an eine Klippe zu n&auml;hern.','2020-12-16 17:43:43'),(1601,'DE','Der Geocache liegt in einem Jagdgebiet. Bei D&auml;mmerung oder Dunkelheit sollte man aus Sicherheitsgr&uuml;nden immer eine Taschenlampe oder Stirnlampe verwenden. Bei Begegnungen mit J&auml;gern ist gegenseitige R&uuml;cksichtnahme angebracht.','2020-12-16 17:43:43'),(1602,'DE','In er N&auml;he des Geocaches gibt es Dornen. Ihr solltet f&uuml;r die Suche entsprechende Handschuhe und Kleidung parat haben.','2020-12-16 17:43:43'),(1603,'DE','Je nach Saison gibt es in dem Gebiet besonders viele Zecken. Es wird daher empfohlen, entsprechend lange Kleidung zu tragen und nach der Cachetour nach Zecken Ausschau zu halten. FSME-Risikogebiete und weitere Informationen zum Thema Zecken k&ouml;nnt ihr z.B. auf <a href=\"http://www.meningitis.de\" target=\"_blank\">www.meningitis.de</a> nachsehen.','2020-12-16 17:43:43'),(1604,'DE','Im Wasser','2020-12-16 17:43:43'),(1605,'DE','Dieser Cache ist jederzeit machbar, sowohl am Tage als auch in der Nacht und an allen Wochentagen.','2020-12-16 17:43:43'),(1606,'DE','Dieser Cache l&auml;sst sich nur zu bestimmten Tageszeiten absolvieren. N&auml;heres ist in der Cachebeschreibung angegeben. Der Cache kann zum Beispiel auf einem Gel&auml;nde mit festgelegten Öffnungszeiten versteckt sein.','2020-12-16 17:43:43'),(1607,'DE','Dieser Cache l&auml;sst sich nur tags&uuml;ber angehen. Ein Beispiel w&auml;ren Gebiete mit Klippen oder Abgr&uuml;nden. Ein anderes Beispiel sind Orte, an denen die Suche mit Taschenlampen in der Dunkelheit besonders negativ auffallen w&uuml;rde (z.B. Wohngebiete).','2020-12-16 17:43:43'),(1608,'DE','Der Geocache kann nur bei bei niedrigem oder normalem Wasserstand bzw. bei Ebbe gesucht werden. Bei Hochwasser oder Flut ist er unzugänglich.','2020-12-16 17:43:43'),(1609,'DE','Dieser Cache l&auml;sst sich w&auml;hrend des gesamten Jahres finden, wobei je nach Jahreszeit die Schwierigkeit bei der Suche schwanken kann. Die Schwierigkeit soll bei guten Bedingungen angegeben werden.','2020-12-16 17:43:43'),(1610,'DE','Dieser Cache sollte in der Brutsaison nicht absolviert werden. Bitte gib in der Beschreibung an, welche Jahreszeit davon betroffen ist. Achte bitte auch auf die örtliche Beschilderung zum Naturschutz.','2020-12-16 17:43:43'),(1611,'DE','Dieser Cache l&auml;sst sich auch nach starkem Schneefall suchen. Die einzelnen Stationen und der Geocache sind so versteckt, dass sie nicht von Schnee verdeckt werden. Bitte auch an Schneehaufen denken, die ggf. durch R&auml;umfahrzeuge entstehen.','2020-12-16 17:43:43'),(1612,'DE','F&uuml;r diesen Cache ben&ouml;tigst du weitere Ausr&uuml;stung, die nicht durch die anderen Attribute angegeben ist und nicht zur Standardausr&uuml;stung eines Geocachers geh&ouml;rt. Zum Beispiel Laserpointer, Funkger&auml;te oder Wagenheber. Was genau du ben&ouml;tigst, ist in der Beschreibung angegeben.','2020-12-16 17:43:43'),(1613,'DE','F&uuml;r diesen Cache braucht ihr einen funktionierenden Kompass f&uuml;r Peilungen oder Orientierungen.','2020-12-16 17:43:43'),(1614,'DE','Um diesen Cache anzugehen, benötigt ihr eine funktionstüchtige Taschenlampe. Denkt immer auch an Ersatzbatterien.','2020-12-16 17:43:43'),(1615,'DE','Um diesen Cache absolvieren zu k&ouml;nnen, ben&ouml;tigt ihr neben der normalen Ausr&uuml;stung auch noch Kletterausr&uuml;stung und entsprechendes Wissen um die Handhabung der Kletterausr&uuml;stung und ums Klettern &ndash; Laien sollten sich auf jeden Fall von einem erfahrenen Kletterer oder Bergsteiger unterst&uuml;tzen lassen.','2020-12-16 17:43:43'),(1616,'DE','Der Geocache ist in einer H&ouml;hle versteckt und man sollte entsprechende Ausr&uuml;stung mitbringen. Vorsicht: Bereits kleinste H&ouml;hlensysteme k&ouml;nnen bei unvorhergesehenen Problemen, z.B. Gewittern (Wasser!) oder einem verstauchten Kn&ouml;chel, sehr gef&auml;hrlich werden! Ihr solltet euch vorab gr&uuml;ndlich bei erfahreren H&ouml;hlengehern informieren. Beachtet auch den Naturschutz &ndash; Fledermausquartiere d&uuml;rfen nicht gest&ouml;rt werden!','2020-12-16 17:43:43'),(1617,'DE','Um den Geocache zu finden ben&ouml;tigt ihr eine Tauchausr&uuml;stung. In welcher Tiefe der Geocache liegt, ist in der Beschreibung angegeben. Bitte beachtet, dass Ihr f&uuml;r einen sicheren Tauchgang eine entsprechende Ausbildung ben&ouml;tigt. Als Nicht-Taucher k&ouml;nnt ihr den Geocache evtl. zusammen mit einem Tauchlehrer suchen.','2020-12-16 17:43:43'),(1618,'DE','Der Geocache kann &ndash; normalerweise &ndash; nicht ohne ein Wasserfahrzeug gefunden werden. Zum Geocache kann wegen der Entfernung oder Str&ouml;mung nicht geschwommen werden. Details dazu sind in der Beschreibung des Geocaches angegeben.','2020-12-16 17:43:43'),(1619,'DE','F&uuml;r diesen Cache muss vorab nach Informationen gesucht werden. Besonders h&auml;ufig kommt dies bei R&auml;tselcaches vor.','2020-12-16 17:43:44'),(1620,'DE','Bei diesem Cache sind als Vorarbeit oder w&auml;hrend der Suche R&auml;tsel zu l&ouml;sen.','2020-12-16 17:43:44'),(1621,'DE','Es m&uuml;ssen vorab oder w&auml;hrend der Suche Rechenaufgaben gel&ouml;st werden, die &uuml;ber das kleine Geocacher-1x1 hinausgehen. Zum Beispiel Mittelpunktberechnungen oder Peilungen.','2020-12-16 17:43:44'),(1622,'DE','Dieser Cache passt in keine der üblichen Kategorien von Caches (Cachearten). Daher gibt dieses Attribut euch die M&ouml;glichkeit, auf besondere Caches aufmerksam zu machen.','2020-12-16 17:43:44'),(1623,'DE','Bei diesem Cache ist es n&ouml;tig, sich vor dem Angehen des Caches beim Eigent&uuml;mer &uuml;ber die Bedingungen zum Angehen zu informieren. Ein Beispiel w&auml;ren Stadtmeisterschaften.','2020-12-16 17:43:44'),(1624,'DE','Der Geocache ist kindgerecht aufgebaut: Alle Aufgaben sind von Kindern im Alter von 10 bis 12 Jahren selbstständig lösbar und das Gelände ist nicht gefährlich (keine Haupstraßen, Klippen o.ä.). Am Ende des Geocaches ist eine Box mit Tauschgegenständen und die Aufgaben sind interessant aufgebaut.','2020-12-16 17:43:44'),(1625,'DE','Der Cache f&uuml;hrt in eine (ehemalige) Bergbauregion. M&ouml;glicherweise bestehen Gefahren durch verst&uuml;rzte Stollenmundl&ouml;cher oder es m&uuml;ssen Stollen betreten werden. Entsprechende Ausr&uuml;stung und Vorsicht, besonders bei Dunkelheit, wird empfohlen. Historische Bergwerke stehen m&ouml;glicherweise unter Denkmalschutz.','2020-12-16 17:43:44'),(1626,'DE','In der N&auml;he des Caches gibt es giftige Pflanzen. Achtet also insbesondere darauf, dass Kinder und Hunde diese nicht anfassen oder essen.','2020-12-16 17:43:44'),(1627,'DE','In dem Gebiet sind Wildtiere angesiedelt, die f&uuml;r Menschen eine Gefahr darstellen k&ouml;nnen, z.B. Tollwutgebiete, giftige Schlangen, Skorpione oder B&auml;ren.','2020-12-16 17:43:44'),(1628,'DE','Es gibt in der Nähe einen Parkplatz, der sich als Startpunkt für die Cachesuche eignet. Falls alle Parkplätze gebührenpflichtig sind, bitte auch das Attribut Zugangs- bzw. Parkentgelt angeben.','2020-12-16 17:43:44'),(1629,'DE','Dieser Cache lässt sich mit Hilfe von öffentlichen Verkehrsmitteln erreichen und liegt außerhalb von Städten. Besonders bei Geocaches die an abgelegenen Aussichtspunkten, Wanderparkplätzen oder Ausflugszielen liegen ist dieses Attribut hilfreich. Für Geocaches in Städten soll dieses Attribut hingegen nicht angegeben werden, da diese in der Regel immer per ÖVM erreichbar sind.','2020-12-16 17:43:44'),(1630,'DE','W&auml;hrend der Cachetour oder in der N&auml;he des Geocaches ist Trinkwasser verf&uuml;gbar. Besonders bei Event-Caches, l&auml;ngeren Multicaches und bei Geocaches, wo man vermutlich schmutzig wird (z.B. manche H&ouml;hlencaches), hilft dieses Attribut bei der Planung der Cachetour.','2020-12-16 17:43:44'),(1631,'DE','W&auml;hrend der Cachetour oder in der N&auml;he des Geocaches ist eine &ouml;ffentliche Toilette verf&uuml;gbar. Besonders bei Event-Caches und bei l&auml;ngeren Multicaches hilft dieses Attribut bei der Planung der Cachetour.','2020-12-16 17:43:44'),(1632,'DE','W&auml;hrend der Cachetour oder in der N&auml;he des Geocaches gibt es ein &ouml;ffentliches Telefon. Besonders bei Event-Caches sollte gepr&uuml;ft werden, ob ein Telefon in der N&auml;he verf&uuml;gbar ist, und das Attribut ggf. ausgew&auml;hlt werden.','2020-12-16 17:43:44'),(1633,'DE','In der N&auml;he des Caches findet ihr eine Erste Hilfe-Station, Notrufs&auml;ule, Bergwacht oder entsprechende Einrichtung. Besonders bei Geocaches in schwierigem Gel&auml;nde ist die Angabe bzw. Pr&uuml;fung dieses Attribut sinnvoll. Z.B. bei Klettercaches, Caches in H&ouml;hlen, im Hochgebirge oder rund um Wildwasserfl&uuml;sse. Es ist auch sinnvoll, die Notrufnummern z.B. der Bergwacht im Cachelisting aufzuf&uuml;hren.','2020-12-16 17:43:44'),(1634,'DE','Der Parkplatz befindet sich in unmittelbarer Nähe zum Geocache. Es sind nicht mehr als einige Schritte notwendig um den Geocache zu finden.','2020-12-16 17:43:44'),(1635,'DE','Bei diesem Cache erwartet euch eine längere Wanderung. Geocaches, bei denen der kürzeste Fußweg vom Parkplatz zum Geocache und zurück weiter als 5 Kilometer ist, sollte man dieses Attribut zuweisen. Im Gebirge und entsprechenden Steigungen ist das Attribut auch bei kürzeren Wegstrecken sinnvoll. Gute Wanderschuhe und entsprechende Ausrüstung empfehlen sich.','2020-12-16 17:43:44'),(1636,'DE','Bei diesem Cache geht es durch sumpfiges oder matschiges Gel&auml;nde oder es muss durch flaches Wasser gewatet werden. Entsprechende Kleidung wird empfohlen. Nach Regenf&auml;llen kann das Gel&auml;nde wesentlich schwerer oder &uuml;berhaupt nicht begehbar sein.','2020-12-16 17:43:44'),(1637,'DE','Auf dem Weg zum Geocache bzw. w&auml;hrend der Cachesuche sind eine oder mehrere Steigungen zu &uuml;berwinden.','2020-12-16 17:43:44'),(1638,'DE','Während der Cachesuche ist leichtes Klettern notwendig, bei dem man sich z.B. mit den Händen festhalten muss. Gute Trittsicherheit und Schwindelfreiheit empfehlen sich. Es ist jedoch keine Spezialausrüstung notwendig wie z.B. Sicherungsseil, Klettersteigset oder Steigeisen. Besonders bei feuchter Witterung oder vor Gewittern sollte man mit der entsprechenden Vorsicht handeln.','2020-12-16 17:43:44'),(1639,'DE','Auf dem Weg zum Geocache muss ein Fluss oder See überquert werden. Das Wasser ist tief genug um zu schwimmen. Je nach Örtlichkeit kann auch ein Schlauchboot, Kajak oder ähnliches verwendet werden (näheres ist in der Beschreibung zum Geocache zu finden). Die Entfernung ist aber ohne besondere Ausdauer noch zu schwimmen.','2020-12-16 17:43:44'),(1640,'DE','Der Geocache ist in unmittelbarer N&auml;he zu einer Sehensw&uuml;rdigkeit versteckt. Das kann ein z.B. sch&ouml;ner Aussichtspunkt oder eine gr&ouml;&szlig;ere Burgruine sein. Ein Besuch w&uuml;rde sich auch ohne besonderen Anlass (den Geocache) lohnen.','2020-12-16 17:43:44'),(1641,'DE','Der Geocache ver&auml;ndert seine Position und ist deshalb nicht immer am gleichen Ort zu finden. Es gibt Varianten, bei denen der Geocache-Besitzer den Geocache regelm&auml;&szlig;ig an anderen Orten versteckt, oder der Finder den Geocache an einem neuen Ort versteckt. Danach muss der Besitzer jeweils die Beschreibung aktualisieren.','2020-12-16 17:43:44'),(1642,'DE','Am Ziel befindet sich eine Webcam, und für einen Fund muss man das Bild der Webcam von sich selbst aufnehmen, um nachzuweisen, dass man vor Ort war. Manche Webcam-Caches setzen auch weitere Bedingungen, z.B. einen Geocaching-Banner auf dem Bild. Die Webadresse der Webcam ist in der Beschreibung angegeben und erfordert kein Benutzerkonto o.ä., um das Webcam-Bild abzurufen.','2020-12-16 17:43:44'),(1643,'DE','Das Ziel des Geocaches liegt nicht im Freien, sondern zum Beispiel in einem Geb&auml;ude oder einer H&ouml;hle.','2020-12-16 17:43:44'),(1644,'DE','Der Geocache oder eine der Stationen ist im Wasser versteckt. Um die Aufgabe zu l&ouml;sen muss man ggf. das Wasser betreten, schwimmen oder tauchen.','2020-12-16 17:43:44'),(1645,'DE','Dieser Cache l&auml;sst sich auch ohne GPS-Empf&auml;nger finden. Die Aufgaben sind so gestellt, dass man außer den Startkoordinaten keine weiteren Koordinaten verwenden muss.','2020-12-16 17:43:44'),(1646,'DE','Um zum Cache zu gelangen, müsst ihr entweder einen Eintritt oder eine Parkgebühr bezahlen. Ein Eintrittsgeld könnte z.B. in einem Freizeitpark anfallen. Falls es trotzdem nahegelegene, entgeltfreie Parkmöglichkeiten gibt, möchten wie euch bitten darauf in der Beschreibung hinzuweisen. Bitte beachtet auch die aktuellen Nutzungsbedingungen zum Thema &bdquo;kommerzielle Geocaches&ldquo;.','2020-12-16 17:43:44'),(1647,'DE','Der Geocache kann nicht mit einer einzigen Tages- oder Nachttour gel&ouml;st werden. Er muss entweder mehrmals angefahren werden oder es muss vor Ort &uuml;bernachtet werden. Bei diesem Attribut soll die Zeit f&uuml;r Recherchen vorab nicht ber&uuml;cksichtigt werden, sondern nur die Zeit vor Ort.','2020-12-16 17:43:44'),(1648,'DE','Ein Newseintrag wurde auf Opencaching erstellt','2020-12-16 17:43:44'),(1650,'DE','Die aufgerufene Seite existiert nicht!','2020-12-16 17:43:44'),(1652,'DE','Weiterleitung - opencaching','2020-12-16 17:43:44'),(1653,'DE','Soll die gespeicherte Suche wirklich gel&ouml;scht werden?','2020-12-16 17:43:44'),(1654,'DE','Status','2020-12-16 17:43:44'),(1655,'DE','Status ändern','2020-12-16 17:43:44'),(1657,'DE','bis','2020-12-16 17:43:44'),(1658,'DE','Der Weg','2020-12-16 17:43:44'),(1659,'DE','Cachegröße:','2020-12-16 17:43:44'),(1660,'DE','Link','2020-12-16 17:43:44'),(1661,'DE','Öffnen','2020-12-16 17:43:44'),(1662,'DE','Zu den Favoriten hinzufügen...','2020-12-16 17:43:44'),(1663,'DE','angezeigte Geocaches:','2020-12-16 17:43:44'),(1664,'DE','Ladezeit:','2020-12-16 17:43:44'),(1665,'DE','Sek.','2020-12-16 17:43:44'),(1666,'DE','Nur Geocaches mit folgenden Eigenschaften anzeigen:','2020-12-16 17:43:44'),(1667,'DE','Cacheart','2020-12-16 17:43:44'),(1668,'DE','Behälter','2020-12-16 17:43:44'),(1669,'DE','Ausblenden','2020-12-16 17:43:44'),(1670,'DE','meine eigenen','2020-12-16 17:43:44'),(1672,'DE','auf GC gelistet','2020-12-16 17:43:44'),(1673,'DE','Bewertung','2020-12-16 17:43:44'),(1674,'DE','min. Empfehlungen:','2020-12-16 17:43:44'),(1678,'DE','Bitte Suchtext eingeben!','2020-12-16 17:43:44'),(1680,