3:45'),(1704,'DE','Du hast diesen Geocache bereits gefunden!','2020-12-16 17:43:45'),(1705,'DE','<i>Veraltet: Dieses Attribut kann bei neuen Geocaches nicht mehr verwendet werden, weil das Attribut unsere aktuellen Nutzungsbedingungen nicht erfüllt</i><br />Dieser Cache ist auf mehreren Geocaching-Seiten gelistet, und die Beschreibung bei Opencaching kann unvollständig sein. Die vollständige Beschreibung auf der/den externen Seiten sollte im Opencaching-Listing verlinkt sein. Wir weisen darauf hin, dass nach unseren aktuellen Nutzungsbedingungen auch stets auf Opencaching die Beschreibungen und der Cachestatus vom Eigentümer aktuell gehalten werden müssen. Dieses Attribut ermöglicht es z.B. PDA-Benutzern, Geocaches gezielt zu filtern, die keine vollständige Beschreibung enthalten und deshalb nicht unterwegs gelöst werden können. ','2020-12-16 17:43:45'),(1706,'DE','Diese OC-Seite','2020-12-16 17:43:45'),(1707,'DE','Andere OC-Seiten','2020-12-16 17:43:45'),(1708,'DE','Die nächsten Events in %1','2020-12-16 17:43:45'),(1709,'DE','Geocaches mit den meisten Empfehlungen innerhalb der letzten %2 Tage in %1.','2020-12-16 17:43:45'),(1710,'DE','Neueste Caches in %1','2020-12-16 17:43:45'),(1711,'DE','Du benötigst noch %1 Fund(e), um eine weitere Empfehlung vorzunehmen.','2020-12-16 17:43:45'),(1713,'DE','Du hast diesen Cache empfohlen.','2020-12-16 17:43:45'),(1714,'DE','Die Empfehlung zurückziehen','2020-12-16 17:43:45'),(1717,'DE','Bitte auswählen!','2020-12-16 17:43:45'),(1718,'DE','Ergebnisse auf dieser Seite','2020-12-16 17:43:45'),(1722,'DE','Möchtest du diesen Eintrag wirklich entfernen?','2020-12-16 17:43:45'),(1723,'DE','Möchtest du wirklich die Empfehlung widerrufen?','2020-12-16 17:43:45'),(1724,'DE','Strecke:','2020-12-16 17:43:45'),(1725,'DE','Download als ...','2020-12-16 17:43:45'),(1726,'DE','Logeintrag für <a href=\"viewcache.php?cacheid={cacheid}\">{cachename}</a> entfernen','2020-12-16 17:43:45'),(1727,'DE','Neue Beschreibung für <a href=\"viewcache.php?