te dich entsprechend umsichtig! <font size=\"1\">(%1Info</a>)</font>','2020-12-16 17:43:46'),(1766,'DE','Dieser Geocache liegt vermutlich in den folgenden Schutzgebieten (%1Info</a>):','2020-12-16 17:43:46'),(1767,'DE','Schnellübersetzung','2020-12-16 17:43:46'),(1768,'DE','Deaktivieren','2020-12-16 17:43:46'),(1769,'DE','Aktivieren - neu','2020-12-16 17:43:46'),(1770,'DE','Aktivieren - Alle','2020-12-16 17:43:46'),(1771,'DE','Text Download (neu)','2020-12-16 17:43:46'),(1772,'DE','Text Download (Alle)','2020-12-16 17:43:46'),(1773,'DE','Text Import','2020-12-16 17:43:46'),(1774,'DE','Text Datei mit den Übersetzungen','2020-12-16 17:43:46'),(1775,'DE','Zusätzliche Wegpunkte','2020-12-16 17:43:46'),(1776,'DE','Wegpunkt-Typ:','2020-12-16 17:43:46'),(1777,'DE','Bitte auswählen','2020-12-16 17:43:46'),(1778,'DE','Koordinaten:','2020-12-16 17:43:46'),(1779,'DE','Download GPX-Datei (max. 500 Caches)','2020-12-16 17:43:46'),(1780,'DE','Wegpunkt hinzufügen','2020-12-16 17:43:46'),(1781,'DE','Hinzufügen','2020-12-16 17:43:46'),(1782,'DE','Wegpunkt Löschen','2020-12-16 17:43:46'),(1783,'DE','Wegpunkt bearbeiten','2020-12-16 17:43:46'),(1788,'DE','Parkplatz','2020-12-16 17:43:46'),(1789,'DE','Station oder Referenzpunkt','2020-12-16 17:43:46'),(1790,'DE','Zusätzliche Wegpunkte','2020-12-16 17:43:46'),(1791,'DE','Wegpunkt hinzufügen','2020-12-16 17:43:46'),(1792,'DE','Zusätzliche Wegpunkte können angelegt werden, um die Suche zu erleichtern, zum Beispiel indem sie einen Parkplatz oder Startpunkt für die Suche angeben. Außerdem können hier die Stationen eines Multicaches eingetragen werden. Die Wegpunkte werden bei Auswahl des Caches auf der Karte angezeigt, sind in heruntergeladenen GPX-Dateien enthalten und werden an das GPS-Gerät gesendet.','2020-12-16 17:43:46'),(1793,'DE','Keine zusätzlichen Wegpunkte angelegt','2020-12-16 17:43:46'),(1794,'DE','Die zusätzlichen Wegpunkte werden bei Auswahl des Caches auf der Karte angezeigt, sind in heruntergeladenen GPX-Dateien enthalten und werden an das GPS-Gerät gesendet.','2020-12-16 17:43:46'),(1796,'DE','Veröffentlicht am:','2020-12-16 17:43:46'),(1797,'DE','Versionsgeschichte','2020-12-16 17:43:46'),(1798,'DE','Verein','2020-12-16 17:43:46'),(1799,'DE','Nur zu bestimmten Zeiten im Jahr','2020-12-16 17:43:46'),(1800,'DE','Dieser Cache l&auml;sst sich nur zu bestimmten Zeite im Jahr absolvieren. N&auml;heres ist in der Cachebeschreibung zu finden. Der Cache kann beispielsweise in einem Maislabyrinth versteckt sein, das nur zwischen Bl&uuml;te- und Erntezeit existiert.','2020-12-16 17:43:46'),(1801,'DE','Hilfe','2020-12-16 17:43:46'),(1802,'DE','Vorsicht: Diese Cachemeldung wird bereits von einem anderen Admin bearbeitet. Bitte sprich dich mit ihm ab, bevor du sie &uuml;bernimmst!','2020-12-16 17:43:46'),(1803,'DE','Nano','2020-12-16 17:43:46'),(1804,'DE','Datenlizenz','2020-12-16 17:43:46'),(1806,'DE','Bitte wähle nur eine der Lösch-/Sperroptionen aus!','2020-12-16 17:43:46'),(1807,'DE','Mit dem Absenden akzeptiere ich die <a href=\"articles.php?page=impressum#tos\" target=\"_blank\">Opencaching.de-Nutzungsbedingungen</a> und -<a href=\"articles.php?page=impressum#datalicense\" target=\"_blank\">Datenlizenz</a>.','2020-12-16 17:43:46'),(1808,'DE','Die <a target=\"_blank\" href=\"articles.php?page=dsb\">Datenschutzerklärung</a>, die <a href=\"articles.php?page=impressum#tos\" target=\"_blank\">Nutzungsbedingungen</a> und die <a href=\"articles.php?page=impressum#datalicense\" target=\"_blank\">Datenlizenz</a> habe ich gelesen und bin damit einverstanden.','2020-12-16 17:43:46'),(1809,'DE','Du musst die Datenschutzerklärung, die Nutzungsbedingungen und die Datenlizenz akzeptieren, um dich bei %1 zu registrieren.','2020-12-16 17:43:46'),(1810,'DE','Mit dem Herunterladen dieser Datei akzeptierst du unsere <a href=\"articles.php?page=impressum#tos\">Nutzungsbedingungen</a> und <a href=\"articles.php?page=impressum#datalicense\" target=\"_blank\">Datenlizenz</a>.','2020-12-16 17:43:46'),(1811,'DE','De