l point to the hiding place, or other special night-caching mechanisms.','2010-09-12 22:54:46'),(1546,'EN','This geocache is listed at Opencaching only. This attribute will enable users of other geocaching platforms to find interesting OC caches quickly.','2010-09-12 22:54:41'),(1548,'EN','There is a stamp in the cache for stamping your personal logbook, and the cache’s logbook will be stamped with your personal stamp. Take care not to mix up stamps and to leave the cache’s stamp in the cache! Frequently letterboxes can be found without GPS, maybe with a compass and paces from a location - add the \"without GPS\" attribute for those.','2010-09-12 22:54:24'),(1549,'EN','The cache is located within a dangerous area. Use this attribute to mark non-obvious dangers, like high-traffic roads, steep ground or falling rocks. Security measures should be taken or the cache be omitted, especially when geocaching with children, large groups or at unfavourable weather conditions.','2010-09-12 22:53:29'),(1550,'EN','Active railway nearby','2010-09-12 23:13:51'),(1551,'EN','Cliff / Rocks','2010-09-12 23:17:29'),(1552,'EN','Hunting','2010-09-12 23:17:34'),(1553,'EN','Thorns','2010-09-12 23:17:39'),(1554,'EN','Ticks','2010-09-12 23:17:17'),(1555,'EN','Abandoned mines','2010-09-12 23:17:25'),(1556,'EN','Poisonous plants','2010-09-12 23:17:03'),(1557,'EN','Dangerous animals','2010-09-12 23:16:58'),(1558,'EN','Parking area nearby','2010-09-12 23:17:11'),(1559,'EN','Public transportation','2010-09-12 23:17:07'),(1560,'EN','Drinking water nearby','2010-09-12 23:16:49'),(1561,'EN','Public restrooms nearby','2010-09-12 23:16:54'),(1562,'EN','Public phone nearby','2010-09-12 23:16:23'),(1563,'EN','First aid available','2010-09-12 23:16:19'),(1564,'EN','Near the parking area','2010-09-12 23:16:41'),(1565,'EN','Long walk','2010-09-12 23:16:27'),(1566,'EN','Swamp, marsh or wading','2010-09-12 23:16:36'),(1567,'EN','Hilly area','2010-09-12 23:16:46'),(1568,'EN','Some climbing (no gear needed)','2010-09-12 23:15:51'),(1569,'EN','Swimming required','2010-09-12 23:15:28'),(1570,'EN','Point of interest','2010-09-12 23:16:15'),(1571,'EN','Moving target','2010-09-12 23:15:56'),(1572,'EN','Webcam','2010-09-12 23:15:32'),(1573,'EN','Wihin enclosed rooms (caves, buildings etc.)','2010-09-12 23:16:05'),(1575,'EN','Without GPS (letterboxes, cistes, compass juggling ...)','2010-09-12 23:15:09'),(1576,'EN','Access or parking fee','2010-09-12 23:15:23'),(1577,'EN','Overnight stay necessary','2010-09-12 23:15:47'),(1578,'EN','Available 24 hours','2010-09-12 23:15:05'),(1579,'EN','Only available at specified times','2010-09-12 23:16:10'),(1580,'EN','By day only','2010-09-12 23:15:41'),(1581,'EN','Not at high water level','2010-09-12 23:15:00'),(1582,'EN','All seasons','2010-09-12 23:14:41'),(1583,'EN','Breeding season / protected nature','2010-09-12 23:15:14'),(1584,'EN','Snow-proof hiding place','2010-09-12 23:14:55'),(1585,'EN','Special equipment','2010-09-12 23:14:50'),(1586,'EN','Compass','2010-09-12 23:14:06'),(1587,'EN','Flashlight','2010-09-12 23:14:46'),(1588,'EN','Climbing gear','2010-09-12 23:14:33'),(1589,'EN','Cave equipment','2010-09-12 23:14:28'),(1590,'EN','Diving equipment','2010-09-12 23:14:17'),(1591,'EN','Watercraft','2010-09-12 23:14:11'),(1592,'EN','Aircraft','2010-09-12 23:14:00'),(1593,'EN','Investigation','2010-09-12 23:13:56'),(1594,'EN','Puzzle / Mystery','2010-09-12 23:13:45'),(1595,'EN','Arithmetical problem','2010-09-12 23:13:41'),(1596,'EN','Other cache type','2010-09-12 23:13:36'),(1597,'EN','Ask owner for start conditions','2010-09-12 23:13:31'),(1598,'EN','Suited for children','2010-09-12 23:13:18'),(1599,'EN','There are active railroads nearby. Please be careful, keep a safe distance and cross the rails only at level crossings etc.!','2010-09-12 23:13:13'),(1600,'EN','There are cliffs or dangerous rocks nearby. Beware of falling rocks at the lower side, and be careful at the upper side of cliffs - especially with children and while mountain biking. It can be very dangerous to take a steep slope towards a cliff, because you may not notice in time where the former ends and the latter starts.','2010-09-12 23:13:08'),(1601,'EN','The geocache is placed within a hunting ground. At twilight and in the dark, a flashlight or headlight should always be used for security reasons. Be considerate when meeting hunters.','2010-09-12 23:13:03'),(1602,'EN','There are thorns near the cache. Wear appropriate clothes.','2010-09-12 23:12:57'),(1603,'EN','There are seasonably many ticks in this area. It is recommended to wear long trousers and to check yourself for ticks after geocaching. There are risk maps for <i>tick-borne encephalitis</i> in the internet, e.g. for Germany at sites like www.meningitis.de (look for FSME there).','2010-09-12 23:12:52'),(1604,'EN','In the water','2010-09-12 23:19:52'),(1605,'EN','This cache can be done both at daylight and at night, and on all weekdays.','2010-09-12 23:30:34'),(1606,'EN','This cache can only be done at certain times of day - see the cache description for more details. For example, the cache may be placed in an area with restricted opening hours.','2010-09-12 23:30:39'),(1607,'EN','This cache shoud be attempted during daylight only. For example, the area may be dangerous and contain cliffs or abysses. Or using flashlights may be inadvisable because it would look suspicious within a residential area.','2010-09-12 23:30:29'),(1608,'EN','This cache can be done only at low or normal water level. At flood or high-tide it is not accessible.','2010-09-12 23:30:43'),(1609,'EN','This cache can be found the whole year round, while difficulty may depend on seasons. Specify difficulty for <i>good</i> conditions.','2010-09-12 23:30:47'),(1610,'EN','Don’t seek this cache during animal breeding season! Please indicate in the cache description which time of year must be avoided. Also, pay attention to the local terms and signs regarding nature protection.','2010-09-12 23:30:23'),(1611,'EN','This cache can be found even after heavy snowing. All stages and the geocache are hidden in a snow-safe way: they will not be covered by fallen snow an not by snow-piles created by snow-clearing vehicles.','2010-09-12 23:30:13'),(1612,'EN','You will need special equipment which is not specified by other attributes, e.g. a laser pointer, walkie-talkies or a car jack.','2010-09-12 23:30:08'),(1613,'EN','A compass is required.','2010-09-12 23:29:32'),(1614,'EN','A flashlight is required for finding this cache. Don’t forget spare batteries!','2010-09-12 23:30:03'),(1615,'EN','For this cache, you will need climbing equipment and the knowledge how to use it properly. If you are a beginner, don’t do it alone but use the support of an experienced climber or mountaineer.','2010-09-12 23:29:40'),(1616,'EN','This geocache is hidden in a cave, and you should use appropriate equipment to access it. Beware: Even small caves may confront you with unforeseen problems and dangers, like thunder storms (water!) or a sprained ankle. Have advice first from cave-experienced people! Also take care of protected nature; e.g. bat places must not be disturbed.','2010-09-12 23:29:02'),(1617,'EN','You will need diving equipment to find this geocache. The water depth of the cache location is specified in the description. Please note that secure diving requires special training. Without diving experience, you may search this cache in company of a diving teacher.','2010-09-12 23:29:52'),(1618,'EN','This cache usually can be found only using a watercraft. Swimming is impossible because of the distance or currents. See the cache description for more details.','2010-09-12 23:29:27'),(1619,'EN','You must investigate additional information before you can seek this cache. This commonly applies to puzzle/mystery caches.','2010-09-12 23:29:18'),(1620,'EN','Puzzles or mysteries have to be solved before or while seeking this cache.','2010-09-12 23:29:13'),(1621,'EN','Before or while seeking this cache, arithmetical problems must be solved which go beyond very basic calculations.','2010-09-12 23:29:08'),(1622,'EN','This is none of the standard, pre-defined types of cache. Use this attribute for special, unusual caches.','2010-09-12 23:28:58'),(1623,'EN','Before doing this cache, you must ask the owner for the starting conditions. E.g. the cache may be linked to certain events at varying dates.','2010-09-12 23:28:53'),(1624,'EN','This geocache is suitable for children. All challenges can be solved by child in the age of 10 to 12 years and the terrain has no risks (like highways, abysms). There should be a large geocache container with trading items inside and the challanges are interesting.','2010-09-12 23:28:48'),(1625,'EN','This cache leads into a (former) mining area. There may be dangers by collapsing adits, or you may need to enter adits. Be careful and use appropriate equipment, especially in the dark. Old mines may be covered by historic preservation.','2010-09-12 23:43:40'),(1626,'EN','There are poisonous plants near the cache. Take care and prevent children and dogs from touching or eating them.','2010-09-12 23:43:45'),(1627,'EN','The area is inhabited by possibly dangerous animals, e.g. rabies areas, venomous snakes, scorpions or bears.','2010-09-12 23:43:35'),(1628,'EN','A nearby parking area is situated as starting point for doing this cache. If no free parking is available, add the \"access or parking fee\" attribute.','2010-09-12 23:43:31'),(1629,'EN','This cache is located outside of urban areas and has a public transport station nearby. Don’t set this attribute for geocaches in urban areas that are commonly equipped with public transportation.','2010-09-12 23:43:17'),(1630,'EN','There is drinking water along the trail or near the cache. This attribute is useful especially for planning event caches, longer hikes or caches at probably dirty locations like caves.','2010-09-12 23:43:10'),(1631,'EN','There are public restrooms along the way or near the cache. This attribute is useful especially for planning event caches or extensive multicaches.','2010-09-12 23:43:04'),(1632,'EN','There is a public phone along the way or near the cache. Especially for event caches you should enquire for nearby phones and set this attribute if applicable.','2010-09-12 23:42:59'),(1633,'EN','There is a first aid station, call box, mountain rescue or similar arrangement near the cache. This attribute is useful especially in demanding areas, like climbing caches, cave caches, high mountains or at the water. Check if you can add emergency phone numbers (like a mountain rescue) to your cache listing.','2010-09-12 23:42:20'),(1634,'EN','The geocache is located close to a parking area, only a few steps away - it’s a \"cache and dash\".','2010-09-12 23:42:28'),(1635,'EN','This cache requires a long walk - more than 5 km round trip. In the mountains and other steep areas, the distance for a \"long walk\" may be shorter. Walking shoes and appropriate equipment are recommended.','2010-09-12 23:42:50'),(1636,'EN','This cache requires passing swampy or marshy ground or wading through shallow water. Wear appropriate clothes. After rainfall, the terrain may be very demanding or not passable at all.','2010-09-12 23:42:38'),(1637,'EN','One or more ascents lie between you and the cache.','2010-09-12 23:42:33'),(1638,'EN','This cache requires some climbing and you may have to use your hands, but you won’t need climbing gear. Be very careful during rainy weather or before thunderstorms!','2010-09-12 23:41:57'),(1639,'EN','This cache requires crossing a river or a lake. The water is steep.','2010-09-12 23:42:11'),(1640,'EN','There is a point of interest at the cache, like a nice scenic overlook or a larger castle ruin. This place is worth visiting it even without a geocache nearby.','2010-09-12 23:42:16'),(1641,'EN','This geocache is moving around. For example, the owner might regularly move the cache from one place to another, or the finders will do this task and post new coordinates in their log entries. The owner must update coordinates in the cache description after each move.','2010-09-12 23:41:49'),(1642,'EN','There is a webcam at the target location. You must record a webcam picture of your visit and include it in your \"found\" log entry. There may be additional requirements like a geocaching banner on the photo. The webcam’s address is included in the cache description, and it must be publicly accessible, i.e. no user account or similar is required.','2010-09-12 23:41:44'),(1643,'EN','This geocache is not hidden in the open air, but within a building, a cave or similar.','2010-09-12 23:41:36'),(1644,'EN','This cache or one of the stages is placed underwater. You may have to enter the water, swim or dive.','2010-09-12 23:41:31'),(1645,'EN','This cache can be found without a GPS device. No additional coordinates are used besides of the starting coordinates.','2010-09-12 23:41:26'),(1646,'EN','You must pay an access or parking fee to access this cache, e.g. if the cache is located within a theme park. If there are alternative free parking areas nearby, please include them in the cache description. Please note our current terms of use regarding \"commercial geocaches\".','2010-09-12 23:41:20'),(1647,'EN','This cache cannot be done within a single day or a single night. You will have to visit the location for more than one time, or you must stay overnight. Preparation time is not included in this calculation, but only the time on site.','2010-09-12 23:41:07'),(1648,'EN','A newsentry was created on opencaching','2010-09-13 00:18:14'),(1650,'EN','The called page does not exist!','2010-09-13 00:17:45'),(1652,'EN','Redirect - opencaching','2010-09-13 00:18:01'),(1653,'EN','Do you really want to delete the saved search?','2010-09-13 00:16:43'),(1654,'EN','Status','2010-09-13 00:16:38'),(1655,'EN','Set status','2010-09-13 00:16:31'),(1657,'EN','to','2010-09-14 01:27:02'),(1658,'EN','Route','2010-09-27 00:21:59'),(165