la noche','2020-12-16 17:43:42'),(1542,'ES','Sólo enlace a otro portal de almacenamiento de cachés','2020-12-16 17:43:42'),(1543,'ES','Letterbox (requiere sello)','2020-12-16 17:43:42'),(1544,'ES','Zona Peligrosa','2020-12-16 17:43:42'),(1545,'ES','Esta caché sólo puede encontrarse por la noche - los llamados <i>cachés nocturnos</i>. Puede haber placas reflectantes que brillaran y te llevaran al caché, u otros mecanismo especiales para cachés nocturnos.','2020-12-16 17:43:42'),(1546,'ES','Este geocaché esta publicado sólo en Opencaching. Este atributo permite a los usuarios de otras plataformas encontrar rápidamente caches interesantes en OC geocaching.','2020-12-16 17:43:42'),(1548,'ES','Hay un sello en el caché para que selles tu libro de registros personal, y debes sellar el libro de visitas del caché con tu propio sello. ¡Ten cuidado de no mezclar los sellos! Frecuentemente los letterboxes pueden encontrarse sin GPS, tal vez con una brújula y unas pautas sobre la ubicación - Añadir el atributo -\"sin GPS\" para este tipo de cachés.','2020-12-16 17:43:42'),(1549,'ES','El caché está situado en una zona peligrosa. Utiliza este atributo para señalar los peligros menos evidentes, tales como carreteras con mucho tráfico, terreno empinado o caída de rocas. Intenta tomar medidas de seguridad o evitar ir a buscar el caché con niños, grupos grandes o en condiciones meteorológicas adversas.','2020-12-16 17:43:42'),(1550,'ES','Ferrocarril activo cerca','2020-12-16 17:43:42'),(1551,'ES','Acantilado / Rocas','2020-12-16 17:43:42'),(1552,'ES','Zona de Caza','2020-12-16 17:43:42'),(1553,'ES','Espinas','2020-12-16 17:43:42'),(1554,'ES','Garrapatas','2020-12-16 17:43:42'),(1555,'ES','Minas abandonadas','2020-12-16 17:43:42'),(1556,'ES','Plantas venenosas','2020-12-16 17:43:42'),(1557,'ES','Animales Peligrosos','2020-12-16 17:43:42'),(1558,'ES','Parking cercano','2020-12-16 17:43:42'),(1559,'ES','Transporte Público','2020-12-16 17:43:42'),(1560,'ES','Agua potable en las cercanias','2020-12-16 17:43:42'),(1561,'ES','Aseos públicos cercanos','2020-12-16 17:43:42'),(1562,'ES','Teléfono Público en las cercanias','2020-12-16 17:43:42'),(1563,'ES','Primeros auxilios disponibles','2020-12-16 17:43:43'),(1564,'ES','Cerca de un Parking','2020-12-16 17:43:43'),(1565,'ES','Larga caminata','2020-12-16 17:43:43'),(1566,'ES','Pantano / terreno fangoso','2020-12-16 17:43:43'),(1567,'ES','Zona montañosa','2020-12-16 17:43:43'),(1568,'ES','Hay que escalar algún tramo (sin equipo)','2020-12-16 17:43:43'),(1569,'ES','Requiere nadar','2020-12-16 17:43:43'),(1570,'ES','Punto de interés','2020-12-16 17:43:43'),(1571,'ES','Objetivo en movimiento','2020-12-16 17:43:43'),(1572,'ES','Cámara web','2020-12-16 17:43:43'),(1573,'ES','Dentro de un lugar cerrado (cuevas, edificios, etc.)','2020-12-16 17:43:43'),(1575,'ES','Sin GPS (letterboxes, cistes, compass juggling ...)','2020-12-16 17:43:43'),(1576,'ES','Acceso o parking de pago','2020-12-16 17:43:43'),(1577,'ES','Necesario pernoctar','2020-12-16 17:43:43'),(1578,'ES','Disponible las 24 horas','2020-12-16 17:43:43'),(1579,'ES','Sólo disponible a ciertas horas','2020-12-16 17:43:43'),(1580,'ES','solo por el día','2020-12-16 17:43:43'),(1582,'ES','Todas las temporadas','2020-12-16 17:43:43'),(1583,'ES','Época de cría / Entorno protegido','2020-12-16 17:43:43'),(1584,'ES','Escondite a prueba de nieve','2020-12-16 17:43:43'),(1585,'ES','Equipamiento especial','2020-12-16 17:43:43'),(1586,'ES','Brújula','2020-12-16 17:43:43'),(1587,'ES','Linterna','2020-12-16 17:43:43'),(1588,'ES','Equipo de escalada','2020-12-16 17:43:43'),(1589,'ES','Equipación para cuevas','2020-12-16 17:43:43'),(1590,'ES','Equipo de buceo','2020-12-16 17:43:43'),(1591,'ES','Barca','2020-12-16 17:43:43'),(1592,'ES','Aeronave','2020-12-16 17:43:43'),(1593,'ES','Investigación','2020-12-16 17:43:43'),(1594,'ES','Puzzle / Misterio','2020-12-16 17:43:43'),(1595,'ES','Problema matemático','2020-12-16 17:43:43'),(1596,'ES','Otro tipo de caché','2020-12-16 17:43:43'),(1597,'ES','Pregunte a los propietarios por las condiciones iniciales','2020-12-16 17:43:43'),(1598,'ES','Apto para niños','2020-12-16 17:43:43'),(1599,'ES','¡Hay ferrocarriles activos en las proximidades. Por favor, ten cuidado, mantén una distancia segura y cruza los railes sólo por los pasos a nivel, etc.!','2020-12-16 17:43:43'),(1600,'ES','Hay acantilados o rocas peligrososas en las cercanias. Ten cuidado con los desprendimientos, tanto cuando estés a los pies del acantilado como cuando estés en la parte de arriba  - especialmente con los niños y en bici. Puede ser muy peligroso tomar una pendiente muy pronunciada para subir el acantilado, ya que es borroso el limite entre lo uno y lo otro.','2020-12-16 17:43:43'),(1601,'ES','El geocaché está colocado dentro de un coto de caza. Al caer la tarde y en la oscuridad,debe utilizarse siempre una linterna o farol por razones de seguridad.','2020-12-16 17:43:43'),(1602,'ES','Hay espinas cerca del caché. Usa ropa apropiada.','2020-12-16 17:43:43'),(1603,'ES','En temporada hay un montón de garrapatas en este lugar. Es recomendable llevar pantalón largo y examinarse en busca de garrapatas después de encontrar el caché.','2020-12-16 17:43:43'),(1604,'ES','En el agua','2020-12-16 17:43:43'),(1605,'ES','Esta caché se puede encontrar tanto de día como de noche y durante toda la semana.','2020-12-16 17:43:43'),(1606,'ES','Este caché se puede hacer sólamente en ciertos momentos del día - véase la descripción del caché para obtener más detalles. Por ejemplo, el caché puede estar colocado en un área con horarios restringidos.','2020-12-16 17:43:43'),(1607,'ES','Este caché sólo debe ser buscado durante el día. Por ejemplo, el área puede ser peligrosa por disponer deacantilados o simas. O quizás, el uso de linternas puede ser desaconsejable porque sería sospechoso en una zona residencial.','2020-12-16 17:43:43'),(1609,'ES','Esta caché puede buscarse durante todo el año, aunque la dificultad puede depender de la estacion. Especificar las dificultades para <i>buenas</i> condiciones.','2020-12-16 17:43:43'),(1610,'ES','¡No busques este caché durante la temporada de cría de los animales! Por favor, indica en la descripción del caché en que periodos del año debe ser evitado. Presta atención también a las señales y ordenanzas localez sobre el respeto hacia la naturaleza.','2020-12-16 17:43:43'),(1611,'ES','Este caché también se puede encontrar después de fuertes nevadas. Todas las etapas y geocachés se encuentran en lugares seguros: no serán cubiertos por la caía de la nieve ni por los montones de los quitanieves.','2020-12-16 17:43:43'),(1612,'ES','Necesitarás un equipo especial no especificado por otros atributos, tales como un puntero láser, walkie-talkie o un gato de coche.','2020-12-16 17:43:43'),(1613,'ES','Se necesita brújula.','2020-12-16 17:43:43'),(1614,'ES','Se necesita linterna para encontrar este caché. ¡No te olvides de las baterías de repuesto!','2020-12-16 17:43:43'),(1615,'ES','Para este caché, necesitarás equipo de escalada y saber cómo utilizarlo correctamente. Si eres un principiante, no lo hagas sólo, utiliza el apoyo de un escalador o montañero experimentado.','2020-12-16 17:43:43'),(1616,'ES','Este geocaché está escondido en una cueva, y se requiere equipo adecuado para acceder a ella. Ten en cuenta que incluso las pequeñas cuevas pueden albergar peligros y problemas no previstos, como durante tormentas (¡agua!) o por un esguince de tobillo. ¡Accede con personas experimentadas en espeleologia! También debe cuidarse la naturaleza, por ejemplo colonias de murcielagos que no merecen ser molestados.','2020-12-16 17:43:43'),(1617,'ES','Necesitarás equipo de buceo para encontrar este geocaché. La profundidad del agua en la ubicación de la caché se especifica en la descripción. Ten en cuenta que el buceo requiere un entrenamiento especial. Si no tienes la devida experiencia, busca un buceador experimentado que te ayude.','2020-12-16 17:43:43'),(1618,'ES','Este caché por lo general sólo se puede encontrar con una embarcación. Nadando es imposible debido a la distancia o la corriente. Lee la descripción del caché para obtener más detalles.','2020-12-16 17:43:44'),(1619,'ES','Necesitas encontrar información adicional antes de poder buscar este cache. Esto se aplica comúnmente a los cachés puzzle o misterio.','2020-12-16 17:43:44'),(1620,'ES','Hay que resolver puzzles o misterios antes o durante la búsqueda de este caché.','2020-12-16 17:43:44'),(1621,'ES','Antes o durante la búsqueda de este cache, deben ser resueltos problemas matemáticos que requeren de algunos sencillos cálculos.','2020-12-16 17:43:44'),(1622,'ES','Este caché no pertenece a ninguna de las categorías predefinidas/estándar. Utiliza este atributo para cachés especiales e inusuales.','2020-12-16 17:43:44'),(1623,'ES','Antes de intentar este cache, debes pregutaral propietario por las condiciones iniciales. Por ejemplo, el caché puede estar relacionado con ciertos eventos de fechas variables.','2020-12-16 17:43:44'),(1624,'ES','Este geocaché es adecuado para niños. Todas las tareas se puede completar por niños entre 10 y 12 años y el terrno no tiene riesgo (tales como carreteras o acantilados). Hay un contenedor grande con intercambio final y los retos son interesantes.','2020-12-16 17:43:44'),(1625,'ES','Este caché conduce a una mina (abandonado). Puede haber peligro con galerias derrumbadas o en las que sea necesario entrar. Ten cuidado y usa el equipo apropiado, especialmente en la oscuridad. Las minas antiguas pueden ser objeto algún tipo de protección como históricas.','2020-12-16 17:43:44'),(1626,'ES','Hay plantas venenosas en las cercanías. Ten cuidado y asegúrate de que los niños o los perros no las toquen ni se las coman.','2020-12-16 17:43:44'),(1627,'ES','Esta zona es frecuentada por animales potencialmente peligrosos, por ejemplo, serpientes venenosas, escorpiones, osos, etc.','2020-12-16 17:43:44'),(1628,'ES','Hay zona de aparcamiento del punto de partida de este caché. Si no hay aparcamiento gratuito, agrega el atributo \"acceso o aparcamiento de pago\".','2020-12-16 17:43:44'),(1629,'ES','Este caché se encuentra fuera de las zonas urbanas y dispone de transporte público cercano. No utilices este atributo para cachés en zonas urbanas que siempre tienen transporte público.','2020-12-16 17:43:44'),(1630,'ES','Hay agua potable a lo largo de la ruta o cerca del caché. Este atributo es especialmente útil en la planificación de eventos,  largas caminatas o cachés en emplazamientos probablemente sucios como cuevas o minas.','2020-12-16 17:43:44'),(1631,'ES','Hay baños públicos a lo largo del camino o en las proximidades del caché. Este atributo es especialmente útil para la planificación de eventos o grandes multicachés.','2020-12-16 17:43:44'),(1632,'ES','Hay teléfonos públicos a lo largo del camino o en las proximidades del caché.','2020-12-16 17:43:44'),(1633,'ES','Hay un punto de primeros auxilios, un teléfono de emergencias, un centro de rescate de montaña o algo similar cerca del caché. Este atributo es especialmente útil en zonas difíciles, como cachés con escaladas, en cuevas, en alta montaña o en el agua. Prueba si puedes agregar un número de teléfono de emergencia (para rescate en montaña, por ejemplo).','2020-12-16 17:43:44'),(1634,'ES','El caché se encuentra cerca de un parking, o a poca distancia.','2020-12-16 17:43:44'),(1635,'ES','Este caché requiere una larga caminata - más de 5 kilometros de ida y vuelta. Entres montañas o áreas escarpadas. Se recomienda calzado para caminar y equipo adecuado.','2020-12-16 17:43:44'),(1636,'ES','Este caché requiere atravesar ciénagas o zonas pantanosas o encharcadas. Usar ropa apropiada. Después de la lluvia, el terreno puede ser difícil o no factible.','2020-12-16 17:43:44'),(1637,'ES','Una o más pendientes para acceder al caché.','2020-12-16 17:43:44'),(1638,'ES','Este caché requiere escalar un poco y puede ser necesario usar las manos, pero no es necesario material de montaña. ¡Ten mucho cuidado durante la temporada de lluvias!','2020-12-16 17:43:44'),(1639,'ES','Este caché requiere cruzar un río o un lago. El nivel del agua es lo suficientemente profundo como para nadar. Puedes utilizar una barca, pero la distancia es lo suficientemente corta como para ser asequible para un nadador.','2020-12-16 17:43:44'),(1640,'ES','Hay algo interesante cerca del caché, como un paisaje hermoso o un castillo en ruinas. Este lugar es digno de visitar, incluso sin un caché cerca.','2020-12-16 17:43:44'),(1641,'ES','Este geocaché está en movimiento. Por ejemplo, el propietario puede mover el caché periódicamente de un lugar a otro, o los geobuscadores podrían hacerlo y ofrecer nuevos detalles en su registro. El propietario debe actualizar las coordenadas en la descripción del caché después de cada movimiento.','2020-12-16 17:43:44'),(1642,'ES','Hay una cámara web en el lugar de destino. Debes tomarte una foto con ella (pantallazo) e incluirla en tu registro de \"encontrado\". Puede haber requisitos adicionales como un logo de geocaching en la imagen. La dirección de la cámara está incluida en la descripción del caché, y deberia ser accesible al público, no es necesario un registro o similares.','2020-12-16 17:43:44'),(1643,'ES','Este geocaché no está al aire libre, sino oculto dentro de un edificio, una cueva o similares.','2020-12-16 17:43:44'),(1644,'ES','Esta caché o una de sus etapas se encuentran bajo el agua. Debes entrar en el agua, nadar o zambullirte.','2020-12-16 17:43:44'),(1645,'ES','Este caché se puede encontrar sin un dispositivo GPS. No se necesitan coordenadas adicionales además de las iniciales.','2020-12-16 17:43:44'),(1646,'ES','Deberás pagar una entrada o estacionamiento para acceder a este caché, por ejemplo, si el caché está situado en un parque temático. Si hay un aparcamiento alternativo gratuito cerca, incluyelo también en la descripción. Por favor, ten en cuenta nuestras condiciones sobre \"geocachés comerciales\".','2020-12-16 17:43:44'),(1647,'ES','No se puede completar este caché en un sólo día o una sóla noche. Tendrás que visitar el lugar más de una vez, o pasar allí la noche. El tiempo de preparación no está incluido en este cálculo, sólo el tiempo en el lugar.','2020-12-16 17:43:44'),(1648,'ES','Una nueva entrada se ha creado en Opencaching','2020-12-16 17:43:44'),(1650,'ES','¡La página solicitada no existe!','2020-12-16 17:43:44'),(1652,'ES','Redireccionar - opencaching','2020-12-16 17:43:44'),(1653,'ES','¿Estás seguro/a que quieres eliminar la búsqueda guardada?','2020-12-16 17:43:44'),(1654,'ES','Status','2020-12-16 17:43:44'),(1655,'ES','Set status','2020-12-16 17:43:44'),(1657,'ES','a','2020-12-16 17:43:44'),(1658,'ES','Ruta','2020-12-16 17:43:44'),(1659,'ES','Cache&nbsp;size:','2020-12-16 17:43:44'),(1660,'ES','Enlace','2020-12-16 17:43:44'),(1661,'ES','Abierto','2020-12-16 17:43:44'),(1662,'ES','Añadir a favoritos...','2020-12-16 17:43:44'),(1663,'ES','Cachés mostrados:','2020-12-16 17:43:44'),(1664,'ES','Tiempo de carga:','2020-12-16 17:43:44'),(1665,'ES','seg','2020-12-16 17:43:44'),(1666,'ES','Mostrar sólo geocachés con las siguientes propiedades:','2020-12-16 17:43:44'),(1667,'ES','Tipo de caché','2020-12-16 17:43:44'),(1668,'ES','Contenedor','2020-12-16 17:43:44'),(1669,'ES','Esconder','2020-12-16 17:43:44'),(1670,'ES','Mios','2020-12-16 17:43:44'),(1672,'ES','listado GC','2020-12-16 17:43:44'),(1673,'ES','Valoración','2020-12-16 17:43:44'),(1674,'ES','Mínimo de recomendaciones:','2020-12-16 17:43:44'),(1678,'ES','¡Introducir un texto a buscar, por favor!','2020-12-16 17:43:44'),(1680,'ES','Punto de referencia %1 no encontrado!','2020-12-16 17:43:44'),(1681,'ES','D/T','2020-12-16 17:43:45'),(1683,'ES','Error: No se pueden descargar los resultados de la búsqueda (código de error HTTP %1)','2020-12-16 17:43:45'),(1684,'ES','Error: No se puedne descargar los resultados de la búsqueda. Los datos no están disponibles en el servidor.','2020-12-16 17:43:45'),(1685,'ES','Hemos e