erán ser actualizadas por igual, incluido Opencaching, según nuestros términos de uso.','2020-12-16 17:43:45'),(1706,'ES','Esto es un nodo OC','2020-12-16 17:43:45'),(1707,'ES','Otros nodos OC','2020-12-16 17:43:45'),(1708,'ES','El próximo evento en %1','2020-12-16 17:43:45'),(1709,'ES','Geocaches with most recommendations in the last %2 days in %1.','2020-12-16 17:43:45'),(1710,'ES','Últimos caches en %1','2020-12-16 17:43:45'),(1711,'ES','You need %1 more found log(s) to make another recommendation.','2020-12-16 17:43:45'),(1713,'ES','Has recomendado este cache.','2020-12-16 17:43:45'),(1714,'ES','Revocar la recomendación','2020-12-16 17:43:45'),(1717,'ES','¡Por favor selelecciona!','2020-12-16 17:43:45'),(1718,'ES','Resultados en esta página','2020-12-16 17:43:45'),(1722,'ES','¿Estás seguro/a que quieres eliminar esta entrada?','2020-12-16 17:43:45'),(1723,'ES','¿Estás seguro que quieres eliminar esta recomendación?','2020-12-16 17:43:45'),(1724,'ES','Route:','2020-12-16 17:43:45'),(1725,'ES','Descargar como...','2020-12-16 17:43:45'),(1726,'ES','Remove log entry for <a href=\"viewcache.php?cacheid={cacheid}\">{cachename}</a>','2020-12-16 17:43:45'),(1727,'ES','Añadir una nueva descripción al cache <a href=\"viewcache.php?cacheid={cacheid}\">{name}</a>','2020-12-16 17:43:45'),(1728,'ES','Enviar a dispositivo GPS','2020-12-16 17:43:45'),(1729,'ES','Historia Geokrety','2020-12-16 17:43:45'),(1730,'ES','Nuevos temas del foro (%1)','2020-12-16 17:43:45'),(1731,'ES','Team blog','2020-12-16 17:43:45'),(1732,'ES','Foro','2020-12-16 17:43:45'),(1733,'ES','Geokrety','2020-12-16 17:43:45'),(1735,'ES','For Event Caches: The date of event!','2020-12-16 17:43:45'),(1736,'ES','ID de Usuario/a:','2020-12-16 17:43:45'),(1737,'ES','Lista','2020-12-16 17:43:45'),(1738,'ES','Fecha del Evento:','2020-12-16 17:43:45'),(1739,'ES','Found: %1   Hidden: %2','2020-12-16 17:43:45'),(1740,'ES','<Unknown user>','2020-12-16 17:43:45'),(1745,'ES','Logo por defecto','2020-12-16 17:43:45'),(1747,'ES','Logo alternativo por nybbler','2020-12-16 17:43:45'),(1752,'ES','Logo alternativo','2020-12-16 17:43:45'),(1753,'ES','Linea delgada','2020-12-16 17:43:45'),(1754,'ES','Logo rojo, Linea delgada','2020-12-16 17:43:46'),(1755,'ES','Linea delgada, sin estadísticas','2020-12-16 17:43:46'),(1756,'ES','Linea delgada roja, sin estadísticas','2020-12-16 17:43:46'),(1757,'ES','Esquinas redondeadas','2020-12-16 17:43:46'),(1758,'ES','The account is already activated. Please try to <a href=\"login.php\">login</a>.<br /> If you cannot login, please read the following page: <a href=\"%1\">Login problems</a>','2020-12-16 17:43:46'),(1759,'ES','Nota:','2020-12-16 17:43:46'),(1760,'ES','Coordinates:','2020-12-16 17:43:46'),(1761,'ES','La nota no es visible para los otros usuarios. La nota y la coordenada opcional serán incluidas en la descarga de archivos GPX y se envía al dispositivo GPS.','2020-12-16 17:43:46'),(1763,'ES','Your browser has rejected our cookie.<br /> For more information on this topic, see <a href=\"%1\">Opencaching help</a>.','2020-12-16 17:43:46'),(1764,'ES','Nota personal de caché','2020-12-16 17:43:46'),(1765,'ES','This geocache is probably placed within a nature reserve! Please see %1here</a> for further information.','2020-12-16 17:43:46'),(1766,'ES','Este caché está probablemente dentro de las siguientes áreas protegidas (%1Info</a>):','2020-12-16 17:43:46'),(1767,'ES','Traducción rápida','2020-12-16 17:43:46'),(1768,'ES','Inhabilitar','2020-12-16 17:43:46'),(1769,'ES','Habilitar - nuevo','2020-12-16 17:43:46'),(1770,'ES','Habilitar - todo','2020-12-16 17:43:46'),(1771,'ES','Text download (new)','2020-12-16 17:43:46'),(1772,'ES','Text download (all)','2020-12-16 17:43:46'),(1773,'ES','Text import','2020-12-16 17:43:46'),(1774,'ES','Archivo de texto que contiene las traducciones:','2020-12-16 17:43:46'),(1775,'ES','Waypoit Adicionales','2020-12-16 17:43:46'),(1776,'ES','Tipo de punto de referencia:','2020-12-16 17:43:46'),(1777,'ES','Por favor, selecciona un tipo','2020-12-16 17:43:46'),(1778,'ES','Coordenadas:','2020-12-16 17:43:46'),(1779,'ES','Descargar fichero GPX (max. 500 cachés)','2020-12-16 17:43:46'),(1780,'ES','Añadir punto de referencia','2020-12-16 17:43:46'),(1781,'ES','Añadir nuevo','2020-12-16 17:43:46'),(1782,'ES','Eliminar punto de referencia','2020-12-16 17:43:46'),(1783,'ES','Editar punto de referencia','2020-12-16 17:43:46'),(1788,'ES','Aparcamiento','2020-12-16 17:43:46'),(1789,'ES','Punto de Referencia','2020-12-16 17:43:46'),(1790,'ES','Puntos de referencia adicionales','2020-12-16 17:43:46'),(1791,'ES','Añadir un punto de referencia','2020-12-16 17:43:46'),(1792,'ES','Pueden introducirse puntos de referencia adicionales para hacer la búsqueda más fácil, por ejemplo, apuntar a un lugar de estacionamiento adecuado o el inicio de un sendero  (la descripción del punto puede contener más información). Los puntos de referencia se muestran sobre el mapa cuando el caché es seleccionado, están incluidos en las descargas de archivos GPX y se enviarán al dispositivo GPS.','2020-12-16 17:43:46'),(1793,'ES','No hay puntos de referencia disponibles','2020-12-16 17:43:46'),(1794,'ES','Los Puntos de referencia adicionales pueden hacer la búsqueda más fácil, por ejemplo, señalando un lugar de estacionamiento adecuado o el inicio de un sendero. Los puntos de referencia se incluyen en las descargas de archivos GPX y se enviarán al dispositivo GPS.','2020-12-16 17:43:46'),(1796,'ES','Publicado en:','2020-12-16 17:43:46'),(1797,'ES','Cambios','2020-12-16 17:43:46'),(1798,'ES','Opencaching e.V.','2020-12-16 17:43:46'),(1799,'ES','Sólo disponible durante las estaciones especificadas','2020-12-16 17:43:46'),(1800,'ES','Este caché se puede realizarse sólo en ciertas épocas del año - lee la descripción del caché para obtener más detalles. Por ejemplo, el cache puede ser colocado en un laberinto de maíz, el cual sólo existe desde la floración hasta la temporada de cosecha.','2020-12-16 17:43:46'),(1801,'ES','Ayuda',