','Le format de sortie sélectionné est inconnu !','2020-12-16 17:43:42'),(1508,'FR','L\'opération de recherche n\'a pas pu être exécuté, s\'il vous plaît entrer de nouveau les données de recherche.','2020-12-16 17:43:42'),(1509,'FR','Trouver','2020-12-16 17:43:42'),(1512,'FR','Le code postal n\'a pas pu être trouvé.','2020-12-16 17:43:42'),(1513,'FR','Il n\'existe aucune ville avec ce nom.','2020-12-16 17:43:42'),(1514,'FR','Il n\'y a pas des coordonnées disponibles pour la ville sélectionnée.','2020-12-16 17:43:42'),(1516,'FR','Le texte entré est invalide.','2020-12-16 17:43:42'),(1517,'FR','Le texte saisi contient plus de 50 mots.','2020-12-16 17:43:42'),(1518,'FR','Tous les pays','2020-12-16 17:43:42'),(1521,'FR','Cette cache a été créé sur un autre site d\'Opencaching. Le cache ne peut pas y être modifié.','2020-12-16 17:43:42'),(1522,'FR','Enregistrer les options','2020-12-16 17:43:42'),(1523,'FR','Modifier les options','2020-12-16 17:43:42'),(1524,'FR','Type','2020-12-16 17:43:42'),(1525,'FR','Derniers logs','2020-12-16 17:43:42'),(1526,'FR','Téléchargements','2020-12-16 17:43:42'),(1527,'FR','Résultats sur cette page&nbsp;:','2020-12-16 17:43:42'),(1529,'FR','Avec le téléchargement, vous acceptez les <a href=\"articles.php?page=impressum#tos\">conditions d\'usage</a> d\'Opencaching.de.&nbsp;&nbsp;','2020-12-16 17:43:42'),(1530,'FR','Cette entrée de log a été créé sur un autre site d\'Opencaching. Il ne peut être édité que là bas.','2020-12-16 17:43:42'),(1531,'FR','Cette description a été créée sur un autre site d\'Opencaching. Elle ne peut être éditée que là bas.','2020-12-16 17:43:42'),(1532,'FR','Le propriétaire de le cache vous a écrit le commentaire suivant :','2020-12-16 17:43:42'),(1533,'FR','Pour des caches virtuelles et webcam, la taille du cache doit être -no boité-&nbsp;!','2020-12-16 17:43:42'),(1537,'FR','Votre code HTML sera à nouveau modifié par un filtre spécial. Cela est nécessaire pour éviter les balises HTML dangereuses, telles que&lt;script&gt;. Une liste avec les balises HTML autorisées, peut être trouvée <a href=\"articles.php?page=htmltags\">ici</a>.','2020-12-16 17:43:42'),(1538,'FR','Langue :','2020-12-16 17:43:42'),(1539,'FR','Non trouvée','2020-12-16 17:43:42'),(1541,'FR','Seulement la nuit','2020-12-16 17:43:42'),(1542,'FR','Lien hypertexte vers un autre portail de mise en cache seulement','2020-12-16 17:43:42'),(1543,'FR','boîte aux lettres (besoin de timbre)','2020-12-16 17:43:42'),(1544,'FR','Zone dangereuse','2020-12-16 17:43:42'),(1545,'FR','Cette géocache peut être trouvé dans la nuit seulement - il est appelé <i>cache de nuit</i>. Il pourrait y avoir des réflecteurs qui doivent être flashlighted et pointer sur la cachette ou d\'autres mécanismes de cache de nuit spéciaux.','2020-12-16 17:43:42'),(1546,'FR','Cette géocache est enregistré à Opencaching seulement. Cet attribut permettra aux utilisateurs d\'autres plates-formes de géocaching de trouver des caches d\'OC intéressants rapidement.','2020-12-16 17:43:42'),(1548,'FR','Il y a un tampon dans le cache pour tamponner votre logbook personnel et le logbook du cache sera tamponné avec votre tampon personnel. Prenez soin de ne pas mélanger les tampons et de laisser le tampon du cache dans le cache&nbsp;! Des boîtes aux lettres populaire peuvent être trouvés sans GPS, peut-être avec une boussole et allures d\'un emplacement - ajouter le «&nbsp;sans GPS&nbsp;» attribut pour ceux.','2020-12-16 17:43:42'),(1549,'FR','Le cache se trouve dans une zone dangereuse. Utilisez cet attribut pour marquer des dangers non évidents, comme les routes à grande circulation, terrain escarpé ou les chutes de pierres. Les mesures de sécurité devraient être prises ou le cache être omises, surtout pendant le géocaching avec des enfants, grands groupes ou à des conditions météorologiques défavorables.','2020-12-16 17:43:42'),(1550,'FR','Chemin de fer actif à proximité','2020-12-16 17:43:42'),(1551,'FR','falaises / rocher','2020-12-16 17:43:42'),(1552,'FR','Chasse','2020-12-16 17:43:42'),(1553,'FR','Épines','2020-12-16 17:43:42'),(1554,'FR','Tiques','2020-12-16 17:43:42'),(1555,'FR','Mines abandonnées','2020-12-16 17:43:42'),(1556,'FR','Plantes toxiques','2020-12-16 17:43:42'),(1557,'FR','Animaux dangereux','2020-12-16 17:43:42'),(1558,'FR','Zone de parking à proximité','2020-12-16 17:43:42'),(1559,'FR','Transport public','2020-12-16 17:43:42'),(1560,'FR','L\'eau potable à proximité','2020-12-16 17:43:42'),(1561,'FR','Toilettes publiques à proximité','2020-12-16 17:43:42'),(1562,'FR','Téléphone public à proximité','2020-12-16 17:43:42'),(1563,'FR','Premiers secours disponibles','2020-12-16 17:43:43'),(1564,'FR','Près de la zone de stationnement','2020-12-16 17:43:43'),(1565,'FR','Longue marche','2020-12-16 17:43:43'),(1566,'FR','Marécage, un marais ou pataugeoire','2020-12-16 17:43:43'),(1567,'FR','Région vallonnée','2020-12-16 17:43:43'),(1568,'FR','Certains escalade (aucun engin nécessaire)','2020-12-16 17:43:43'),(1569,'FR','Baigner requise','2020-12-16 17:43:43'),(1570,'FR','Point d\'intérêt','2020-12-16 17:43:43'),(1571,'FR','Cible mouvante','2020-12-16 17:43:43'),(1572,'FR','Webcam','2020-12-16 17:43:43'),(1573,'FR','Dans des pièces fermées (grottes, bâtiments, etc.)','2020-12-16 17:43:43'),(1575,'FR','Sans GPS (boîte aux lettres, cistes, boussole jonglage ...)','2020-12-16 17:43:43'),(1576,'FR','Frais d\'accès ou de stationnement','2020-12-16 17:43:43'),(1577,'FR','Nuitée nécessaire','2020-12-16 17:43:43'),(1578,'FR','Disponible 24 heures','2020-12-16 17:43:43'),(1579,'FR','Uniquement disponible à des moments précis','2020-12-16 17:43:43'),(1580,'FR','le jour seulement','2020-12-16 17:43:43'),(1581,'FR','Pas du niveau d\'eau élevé','2020-12-16 17:43:43'),(1582,'FR','Toutes les saisons','2020-12-16 17:43:43'),(1583,'FR','Saison de reproduction / nature préservée','2020-12-16 17:43:43'),(1584,'FR','Cachette impperméable à la neige','2020-12-16 17:43:43'),(1585,'FR','Équipement spécial','2020-12-16 17:43:43'),(1586,'FR','Boussole','2020-12-16 17:43:43'),(1587,'FR','Lampe de poche','2020-12-16 17:43:43'),(1588,'FR','Matériel d\'escalade','2020-12-16 17:43:43'),(1589,'FR','Équipement de grotte','2020-12-16 17:43:43'),(1590,'FR','Équipement de plongée','2020-12-16 17:43:43'),(1591,'FR','Motomarine','2020-12-16 17:43:43'),(1592,'FR','Avion','2020-12-16 17:43:43'),(1593,'FR','Enquête','2020-12-16 17:43:43'),(1594,'FR','Puzzle / Mystère','2020-12-16 17:43:43'),(1595,'FR','Problème d\'arithmétique','2020-12-16 17:43:43'),(1596,'FR','Autre type de cache','2020-12-16 17:43:43'),(1597,'FR','Demander au propriétaire pour les conditions de démarrage','2020-12-16 17:43:43'),(1598,'FR','Adapté pour les enfants','2020-12-16 17:43:43'),(1599,'FR','Il y a des chemins de fer actifs à proximité. S\'il vous plaît soyez prudent, garder une distance sécuritaire et traverser les rails seulement aux passages à niveau, etc.&nbsp;!','2020-12-16 17:43:43'),(1600,'FR','Il y a des falaises ou des rochers dangereux à proximité. Méfiez-vous des chutes de pierres sur le côté inférieur, et faire attention à la face supérieure des falaises - en particulier avec des enfants et en faisant du vélo de montagne. Il peut être très dangereux de prendre une pente raide vers une falaise, parce que vous pourriez ne pas remarquer où les premiers terminent et les derniers commencent.','2020-12-16 17:43:43'),(1601,'FR','L géocache est placé dans un terrain de chasse. Au crépuscule et dans l\'obscurité, une lampe de poche ou des phares doivent toujours être utilisés pour des raisons de sécurité. Soyez attentif lors de la rencontre des chasseurs.','2020-12-16 17:43:43'),(1602,'FR','Il y a des épines près du cache. Portez des vêtements appropriés.','2020-12-16 17:43:43'),(1603,'FR','Il y a saisonnellement beaucoup de tiques dans ce domaine. Il est recommandé de porter des pantalons longs et de vérifier vous-même pour les tiques après géocaching. Il y a des cartes de risque pour l\'encéphalite à tiques dans l\'Internet, par exemple, pour l\'Allemagne sur des sites comme www.meningitis.de (FSME chercher là-bas).','2020-12-16 17:43:43'),(1604,'FR','Dans l\'eau','2020-12-16 17:43:43'),(1605,'FR','Ce cache peut être fait à la fois à la lumière du jour et de la nuit, et tous les jours ouvrables.','2020-12-16 17:43:43'),(1606,'FR','Ce cache ne peut pas être fait à certains moments de la journée - voir la description de cache pour plus de détails. Par exemple, le cache peut être placé dans une zone avec des heures d\'ouverture limitées.','2020-12-16 17:43:43'),(1607,'FR','Ce cache devraient être tenté pendant le jour seulement. Par exemple, la zone peut être dangereux et contenir des falaises ou des abîmes. Ou en utilisant des lampes de poche peut être infaisable parce que cela aurait paru suspect dans un quartier résidentiel.','2020-12-16 17:43:43'),(1608,'FR','Ce cache peut être fait seulement au niveau de l\'eau est faible ou normal. Au inondation ou de la marée haute, il est pas accessible.','2020-12-16 17:43:43'),(1609,'FR','Ce cache peut être trouvé toute l\'année, tandis que la difficulté peut varier de saisons. Spécifiez la difficulté pour de <i>bonnes</i> conditions.','2020-12-16 17:43:43'),(1610,'FR','Ne cherchez pas ce cache pendant la saison de reproduction des animaux&nbsp;! S\'il vous plaît indiquer dans la description de cache quelle période de l\'année doit être évitée. Aussi, faites attention aux conditions locales et les signes concernant la protection de la nature.','2020-12-16 17:43:43'),(1611,'FR','Ce cache peut être trouvé même après une chute de neige lourde. Toutes les étapes et la géocache sont cachés dans une manière de neige sûre&nbsp;: ils ne seront pas couverts par la neige tombée non pas par la neige-pieux créés par des véhicules de déneigement.','2020-12-16 17:43:43'),(1612,'FR','Vous aurez besoin d\'équipement spécial qui est pas spécifié par d\'autres attributs, par exemple, un pointeur laser, talkies-walkies ou un cric de voiture.','2020-12-16 17:43:43'),(1613,'FR','Une boussole est nécessaire.','2020-12-16 17:43:43'),(1614,'FR','Une lampe de poche est nécessaire pour trouver ce cache. Ne pas oublier les piles de rechange&nbsp;!','2020-12-16 17:43:43'),(1615,'FR','Pour ce cache, vous aurez besoin d\'équipement d\'escalade et la connaissance comment l\'utiliser correctement. Si vous êtes un débutant, ne pas le faire seul, mais utiliser le support d\'un grimpeur ou alpiniste expérimenté.','2020-12-16 17:43:43'),(1616,'FR','Ce géocache est caché dans une grotte et vous devez utiliser un équipement approprié pour y accéder. Attention&nbsp;: Même de petites grottes peuvent vous confronter à des problèmes imprévus et les dangers, comme les orages (l\'eau&nbsp;!) ou une entorse à la cheville. Avoir des conseils d\'abord de les hommes des cavernes-connu&nbsp;! Aussi prendre soin de la nature protégée&nbsp;; par exemple lieux de chauves-souris doivent ne pas être perturbés.','2020-12-16 17:43:43'),(1617,'FR','Vous aurez besoin d\'équipement de plongée pour trouver ce géocache. La profondeur de l\'emplacement du cache de l\'eau est indiquée dans la description. S\'il vous plaît noter que la plongée sécurisé exige une formation spéciale. Sans expérience de plongée, vous pouvez chercher ce cache en compagnie d\'un professeur de plongée.','2020-12-16 17:43:43'),(1618,'FR','Ce cache peut généralement être trouvé en utilisant seulement une motomarine. La natation est impossible en raison de la distance ou des courants. Voir la description de cache pour plus de détails.','2020-12-16 17:43:43'),(1619,'FR','Vous devez enquêter sur des informations supplémentaires avant de pouvoir chercher ce cache. Cela vaut des puzzle/caches mystère.','2020-12-16 17:43:44'),(1620,'FR','Puzzles ou mystères doivent être résolus avant ou tout en cherchant ce cache.','2020-12-16 17:43:44'),(1621,'FR','Avant ou tout en cherchant ce cache, les problèmes arithmétiques doivent être résolus qui vont au-delà des calculs très élémentaires.','2020-12-16 17:43:44'),(1622,'FR','Ce ne sont pas les standards, les types prédéfinis de cache. Utilisez cet attribut pour les caches, spécial ou inhabituel.','2020-12-16 17:43:44'),(1623,'FR','Avant de faire ce cache, vous devez demander au propriétaire pour les conditions de départ. Par exemple le cache peut être lié à certains événements à des dates différentes.','2020-12-16 17:43:44'),(1624,'FR','Cette géocache est adapté pour les enfants. Tous les défis peuvent être résolus par des enfants de l\'âge de 10 à 12 ans et le terrain n\'a pas de risques (comme les autoroutes, les abîmes). Il devrait y avoir un grand récipient géocache avec des éléments de négociation à l\'intérieur et les défis sont intéressants.','2020-12-16 17:43:44'),(1625,'FR','Ce cache conduit dans un (ancien) zone d\'exploitation minière. Il peut y avoir des dangers par l\'effondrement des galeries d\'accès ou vous pouvez avoir besoin d\'entrer dans les galeries d\'accès. Soyez prudent et utiliser un équipement approprié, surtout dans l\'obscurité. Anciennes mines peuvent être couverts par la préservation historique.','2020-12-16 17:43:44'),(1626,'FR','Il y a des plantes toxiques à proximité du cache. Prenez soin de prévenir les enfants et les chiens de les toucher ou de les manger.','2020-12-16 17:43:44'),(1627,'FR','La région est habitée par des animaux potentiellement dangereux, par exemple, domaines de la rage, des serpents venimeux, des scorpions ou des ours.','2020-12-16 17:43:44'),(1628,'FR','Une zone de parking à proximité est situé comme point de départ pour faire cette cache. Si aucun parking gratuit est disponible, ajouter l\'attribute «&nbsp;des frais d\'accès ou de stationnement&nbsp;».','2020-12-16 17:43:44'),(1629,'FR','Ce cache est situé à l\'extérieur des zones urbaines et a une station de transports en commun à proximité. Ne pas définir cet attribut pour les géocaches dans les zones urbaines qui sont généralement équipées avec les transports publics.','2020-12-16 17:43:44'),(1630,'FR','Il y a de l\'eau potable le long du sentier ou près de la cache. Cet attribut est particulièrement utile pour la planification des caches d\'événements, des randonnées plus longues ou des caches à des endroits probablement sales comme des grottes.','2020-12-16 17:43:44'),(1631,'FR','Il y a des toilettes publiques le long du chemin ou près de la cache. Cet attribut est particulièrement utile pour la planification des caches d\'événements ou de vastes multicaches.','2020-12-16 17:43:44'),(1632,'FR','Il y a un téléphone public le long du chemin ou près de la cache. Surtout pour les caches d\'événements vous devriez vous renseigner pour les téléphones à proximité et définir cet attribut si applicable.','2020-12-16 17:43:44'),(1633,'FR','Il y a un poste de premiers secours, une cabine téléphonique, le sauvetage en montagne ou un arrangement similaire près de la cache. Cet attribut est particulièrement utile dans les zones exigeants, comme les caches, les caches d\'escalade de la grotte, les hautes montagnes ou à l\'eau. Vérifiez si vous pouvez ajouter des numéros de téléphone d\'urgence (comme une opération de sauvetage de montagne) à votre liste de cache.','2020-12-16 17:43:44'),(1634,'FR','La géocache se trouve à proximité d\'une aire de stationnement, à seulement quelques pas de là - il est un «&nbsp;cache and dash&nbsp;».','2020-12-16 17:43:44'),(1635,'FR','Ce cache nécessite une longue marche - plus de 5 km aller-retour. Dans les montagnes et des autres zones escarpées, la distance pour une «&nbsp;longue marche&nbsp;» peut être plus courte. Chaussures de marche et de l\'équipement approprié sont recommandées.','2020-12-16 17:43:44'),(1636,'FR','Ce cache nécessite passant sol marécageux ou marécageuse ou patauger dans l\'eau peu profonde. Portez des vêtements appropriés. Après la pluie, le terrain peut être très exigeant ou non praticable à tous.','2020-12-16 17:43:44'),(1637,'FR','Un ou plusieurs ascensions se trouvent entre vous et le cache.','2020-12-16 17:43:44'),(1638,'FR','Ce cache nécessite un peu d\'escalade et vous devez peut-être utiliser vos mains, mais vous n\'avez pas besoin de matériel d\'escalade. Soyez très prudent pendant la saison des pluies ou des orages&nbsp;!','2020-12-16 17:43:44'),(1639,'FR','Ce cache prescrit de traverser une rivière ou un lac. L\'eau est raide.','2020-12-16 17:43:44'),(1640,'FR','Il y a un point d\'intérêt à la cache, comme une belle vue pittoresque ou un plus grand château en ruines. Cet endroit vaut le détour même sans une géocache à proximité.','2020-12-16 17:43:44'),(1641,'FR','Cette géocache se déplace autour. Par exemple, le propriétaire pourrait déplacer régulièrement le cache d\'un endroit à un autre, ou les trouveurs feront cette tâche et poster de nouveaux coordonnées dans leurs entrées de journal. Le propriétaire doit mettre à jour les coordonnées dans la description de cache après chaque coup.','2020-12-16 17:43:44'),(1642,'FR','Il existe une webcam à l\'emplacement cible. Vous devez prendre une photo de la webcam de votre visite et l\'inclure dans votre «&nbsp;trouvé&nbsp;» entrée du journal. Il peut y avoir des exigences supplémentaires comme une bannière de géocaching sur la photo. L\'adresse de la webcam est inclus dans la description de cache, et il doit être accessible au public, à savoir pas de compte utilisateur ou similaire est nécessaire.','2020-12-16 17:43:44'),(1643,'FR','Cette géocache est pas caché à l\'air libre, mais à l\'intérieur d\'un bâtiment, une grotte ou similaire.','2020-12-16 17:43:44'),(1644,'FR','Ce cache ou l\'un des étages est placée sous l\'eau. Vous pourriez avoir à entrer dans l\'eau, nager ou plonger.','2020-12-16 17:43:44'),(1645,'FR','Ce cache peut être trouvée sans un dispositif GPS. Pas de coordonnées supplémentaires sont utilisés en plus des coordonnées de départ.','2020-12-16 17:43:44'),(1646,'FR','Vous devez payer un frais d\'accès ou de stationnement pour accéder à ce cache, par exemple, si le cache est situé dans un parc d\'attractions. Si il y a des zones de stationnement gratuit à proximité de rechange, s\'il vous plaît de les inclure dans la description de cache. S\'il vous plaît noter nos conditions d\'utilisation actuelles concernant les «&nbsp;géocaches commerciales&nbsp;».','2020-12-16 17:43:44'),(1647,'FR','Ce cache ne peut pas être fait en un seul jour ou une seule nuit. Vous devrez visiter l\'emplacement pour plus d\'une fois ou vous devez passer la nuit. Le temps de préparation n\'est pas inclus dans ce calcul, seulement le temps sur le site.','2020-12-16 17:43:44'),(1648,'FR','Un newsentry a été créé sur Opencaching','2020-12-16 17:43:44'),(1650,'FR','La page appelée n\'existe pas !','2020-12-16 17:43:44'),(1652,'FR','Rediriger - Opencaching','2020-12-16 17:43:44'),(1653,'FR','Voulez-vous vraiment supprimer la recherche enregistrée&nbsp;?','2020-12-16 17:43:44'),(1654,'FR','Statut','2020-12-16 17:43:44'),(1655,'FR','Définir le statut','2020-12-16 17:43:44'),(1657,'FR','à','2020-12-16 17:43:44'),(1658,'FR','Itinéraire','2020-12-16 17:43:44'),(1659,'FR','Taille de cache :','2020-12-16 17:43:44'),(1660,'FR','Lien','2020-12-16 17:43:44'),(1661,'FR','Ouvert','2020-12-16 17:43:44'),(1662,'FR','Ajouter aux Favoris ...','2020-12-16 17:43:44'),(1663,'FR','Caches affichés :','2020-12-16 17:43:44'),(1664,'FR','Temps de chargement :','2020-12-16 17:43:44'),(1665,'FR','Sec.','2020-12-16 17:43:44'),(1666,'FR','Afficher seulement les géocaches avec les propriétés suivantes&nbsp;:','2020-12-16 17:43:44'),(1667,'FR','Type de géocache','2020-12-16 17:43:44'),(1668,'FR','Boîte','2020-12-16 17:43:44'),(1669,'FR','Cacher','2020-12-16 17:43:44'),(1670,'FR','Mon propriétaire','2020-12-16 17:43:44'),(1672,'FR','Listes de GC','2020-12-16 17:43:44'),(1673,'FR','Notation','2020-12-16 17:43:44'),(1674,'FR','Min. recommandations&nbsp;:','2020-12-16 17:43:44'),(1678,'FR','Saisissez un texte de recherche, s\\\'il vous plaît&nbsp;!','2020-12-16 17:43:44'),(1680,'FR','Waypoint %1 non trouvé&nbsp;!','2020-12-16 17:43:44'),(1681,'FR',