mat:&nbsp;DD-MM-JJJJ','2020-12-16 17:43:41'),(1461,'IT','La cache può essere adottata soltanto se si approvano le nostri condizioni d\'utilizzo.','2020-12-16 17:43:41'),(1463,'IT','Tipo della cache non selezionato!','2020-12-16 17:43:41'),(1464,'IT','Dimensione della cache non selezionata!','2020-12-16 17:43:41'),(1466,'IT','La cache è registrata nel database. Ora verrai reindirizzato alla pagina della cache.','2020-12-16 17:43:41'),(1467,'IT','Seleziona','2020-12-16 17:43:41'),(1468,'IT','(internal error) The description is not available.','2020-12-16 17:43:41'),(1469,'IT','(internal error) There already exists a description for this language.','2020-12-16 17:43:41'),(1471,'IT','There already exists a description in this language.','2020-12-16 17:43:41'),(1473,'IT','Vuoi veramente cancellare questo log?','2020-12-16 17:43:41'),(1475,'IT','Un comando di database non può essere completato.','2020-12-16 17:43:41'),(1476,'IT','Modifica cache <a href=\"viewcache.php?cacheid={cacheid}\">{name}</a>','2020-12-16 17:43:41'),(1477,'IT','offerta in adozione','2020-12-16 17:43:41'),(1478,'IT','Status:','2020-12-16 17:43:41'),(1479,'IT','Waypoint search','2020-12-16 17:43:41'),(1480,'IT','Siti locali','2020-12-16 17:43:41'),(1482,'IT','Waypoint:','2020-12-16 17:43:41'),(1483,'IT','&nbsp;','2020-12-16 17:43:41'),(1486,'IT','Se il tuo browser non supporta il reindirizzamento automatico, clicca qui.','2020-12-16 17:43:41'),(1489,'IT','DE','2020-12-16 17:43:41'),(1490,'IT','Password:','2020-12-16 17:43:41'),(1491,'IT','edit cache description for <a href=\"viewcache.php?cacheid={cacheid}\">{cachename}</a>','2020-12-16 17:43:41'),(1494,'IT','Aggiungere','2020-12-16 17:43:42'),(1495,'IT','Inserisci un nome, per favore!','2020-12-16 17:43:42'),(1496,'IT','Completa il campo testo, per favore!','2020-12-16 17:43:42'),(1497,'IT','Devi selezionare almeno un campo!','2020-12-16 17:43:42'),(1498,'IT','La longitudine deve essere un numero!\\nFormato: hh° mm.mmm','2020-12-16 17:43:42'),(1499,'IT','La latitudine deve essere un numero!\\nFormato: hh° mm.mmm','2020-12-16 17:43:42'),(1500,'IT','La distanza massima deve essere un numero!','2020-12-16 17:43:42'),(1501,'IT','La distanza deve essere compresa tra 0 e 9999','2020-12-16 17:43:42'),(1502,'IT','Inserisci un codice postale, per favore!','2020-12-16 17:43:42'),(1503,'IT','Inserisci la città, per favore!','2020-12-16 17:43:42'),(1504,'IT','Inserisci il proprietario, per favore!','2020-12-16 17:43:42'),(1505,'IT','Inserisci l\'utente, per favore!','2020-12-16 17:43:42'),(1506,'IT','Registrate su più siti (waypoint presente in gc.com)','2020-12-16 17:43:42'),(1507,'IT','Il formato di uscita selezionato è sconosciuto!','2020-12-16 17:43:42'),(1508,'IT','La ricerca non può essere eseguita, per favore reinserisci i dati di ricerca.','2020-12-16 17:43:42'),(1509,'IT','Trovata','2020-12-16 17:43:42'),(1512,'IT','Il codice postale non è stato trovato.','2020-12-16 17:43:42'),(1513,'IT','There is no city with this name.','2020-12-16 17:43:42'),(1514,'IT','There are no coordinates available for the selected city.','2020-12-16 17:43:42'),(1516,'IT','Il testo inserito non è valido.','2020-12-16 17:43:42'),(1517,'IT','Il testo inserito contiene più di 50 parole','2020-12-16 17:43:42'),(1518,'IT','Tutte le nazioni','2020-12-16 17:43:42'),(1521,'IT','Questa cache è stata creata su un altro Web server Opencaching e può essere modificata solo su quello.','2020-12-16 17:43:42'),(1522,'IT','Salva opzioni','2020-12-16 17:43:42'),(1523,'IT','Modifica opzioni','2020-12-16 17:43:42'),(1524,'IT','Tipo','2020-12-16 17:43:42'),(1525,'IT','Ultimo log','2020-12-16 17:43:42'),(1526,'IT','Scarichi','2020-12-16 17:43:42'),(1527,'IT','Risultati su questa pagina:','2020-12-16 17:43:42'),(1529,'IT','Scaricando il file accetti le <a href=\"articles.php?page=impressum#tos\">condizioni d\'uso</a> di Opencaching.de.&nbsp;&nbsp;','2020-12-16 17:43:42'),(1530,'IT','This log entry has been created on another Opencaching website. It can only be edited there.','2020-12-16 17:43:42'),(1531,'IT','This description has been created on another Opencaching website. It can only be edited there.','2020-12-16 17:43:42'),(1532,'IT','The owner of the cache has written you the following comment to you:','2020-12-16 17:43:42'),(1533,'IT','Per cache virtuali e webcam, la dimensione del contenitore deve essere -nessun contenitore-!','2020-12-16 17:43:42'),(1537,'IT','Your HTML code will be changed again by a special filter. This is necessary to avoid dangerous HTML-tags, such as &lt;script&gt;. A list of allowed HTML tags can be find <a href=\"articles.php?page=htmltags\">here</a>.','2020-12-16 17:43:42'),(1538,'IT','Language:','2020-12-16 17:43:42'),(1539,'IT','Didn\'t find','2020-12-16 17:43:42'),(1541,'IT','Solo di notte','2020-12-16 17:43:42'),(1542,'IT','Solo collegamento ad un altro portale di caching','2020-12-16 17:43:42'),(1543,'IT','Letterbox (richiede un timbro)','2020-12-16 17:43:42'),(1544,'IT','Area pericolosa','2020-12-16 17:43:42'),(1545,'IT','Questa cache può essere trovata solo di notte - è una cosiddetta <i>cache notturna</i>. Ci possono essere targhette riflettenti che devono essere illuminate e ti conducono al nascondiglio, o altri speciali meccanismi di caching notturno.','2020-12-16 17:43:42'),(1546,'IT','Questa geocache è pubblicata solo su Opencaching. Questo attributo permette agli utenti di altre piattaforme di geocaching di trovare velocemente interessanti cache OC di qualità.','2020-12-16 17:43:42'),(1548,'IT','C\'è un timbro nella cache per timbrare il tuo quaderno personale, e il log della cache verrà timbrato con il tuo timbro personale. Fate attenzione a non confondere i timbri e a lasciare il timbro della cache nella cache! Spesso le letterbox possono essere trovate senza GPS, magari con una bussola e contando i passi - in questo caso aggiungici l\'attributo \"senza GPS\".','2020-12-16 17:43:42'),(1549,'IT','La cache è situata in un\'area pericolosa. Usa questo attributo per segnalare pericoli non ovvi, come strade ad alto traffico, terreno ripido o caduta sassi. Si dovrebbero adottare misure di sicurezza o evitare di andare a cercare la cache, in particolare nel geocaching con bambini, con gruppi numerosi o in condizioni climatiche sfavorevoli.','2020-12-16 17:43:42'),(1550,'IT','Ferrovia attiva nei pressi','2020-12-16 17:43:42'),(1551,'IT','Scogliera / Rocce','2020-12-16 17:43:42'),(1552,'IT','Caccia','2020-12-16 17:43:42'),(1553,'IT','Spine','2020-12-16 17:43:42'),(1554,'IT','Zecche','2020-12-16 17:43:42'),(1555,'IT','Miniere abbandonate','2020-12-16 17:43:42'),(1556,'IT','Piante velenose','2020-12-16 17:43:42'),(1557,'IT','Animali pericolosi','2020-12-16 17:43:42'),(1558,'IT','Parcheggio nei pressi','2020-12-16 17:43:42'),(1559,'IT','Trasporto pubblico','2020-12-16 17:43:42'),(1560,'IT','Acqua potabile nei pressi','2020-12-16 17:43:42'),(1561,'IT','Bagni pubblici nei pressi','2020-12-16 17:43:42'),(1562,'IT','Telefono pubblico nei pressi','2020-12-16 17:43:43'),(1563,'IT','Disponibile pronto soccorso','2020-12-16 17:43:43'),(1564,'IT','Vicino all\'area di parcheggio','2020-12-16 17:43:43'),(1565,'IT','Lunga camminata','2020-12-16 17:43:43'),(1566,'IT','Palude o marcita','2020-12-16 17:43:43'),(1567,'IT','Area collinare','2020-12-16 17:43:43'),(1568,'IT','Arrampicata (attrezzatura non necessaria)','2020-12-16 17:43:43'),(1569,'IT','Nuoto necessario','2020-12-16 17:43:43'),(1570,'IT','Punto di interesse','2020-12-16 17:43:43'),(1571,'IT','Oggetto in movimento','2020-12-16 17:43:43'),(1572,'IT','Webcam','2020-12-16 17:43:43'),(1573,'IT','All\'interno di stanze chiuse (caverne, edifici, ecc.)','2020-12-16 17:43:43'),(1575,'IT','Senza GPS (letterboxes, cistes, compass juggling ...)','2020-12-16 17:43:43'),(1576,'IT','Tassa di ingresso o di parcheggio','2020-12-16 17:43:43'),(1577,'IT','Necessario pernottamento','2020-12-16 17:43:43'),(1578,'IT','Disponibile 24 ore','2020-12-16 17:43:43'),(1579,'IT','Disponibile solo in certi orari','2020-12-16 17:43:43'),(1580,'IT','solo di giorno','2020-12-16 17:43:43'),(1581,'IT','Non disponibile con alto livello di acqua','2020-12-16 17:43:43'),(1582,'IT','Tutte le stagioni','2020-12-16 17:43:43'),(1583,'IT','Stagione di riproduzione / natura protetta','2020-12-16 17:43:43'),(1584,'IT','Luogo a prova di neve','2020-12-16 17:43:43'),(1585,'IT','Equipaggiamento speciale','2020-12-16 17:43:43'),(1586,'IT','Bussola','2020-12-16 17:43:43'),(1587,'IT','Lampada tascabile','2020-12-16 17:43:43'),(1588,'IT','Attrezzatura per arrampicata','2020-12-16 17:43:43'),(1589,'IT','Attrezzatura per grotta','2020-12-16 17:43:43'),(1590,'IT','Attrezzatura per immersione','2020-12-16 17:43:43'),(1591,'IT','Barca','2020-12-16 17:43:43'),(1592,'IT','Elicottero','2020-12-16 17:43:43'),(1593,'IT','Ricerca','2020-12-16 17:43:43'),(1594,'IT','Puzzle / Mystery','2020-12-16 17:43:43'),(1595,'IT','Problema matematico','2020-12-16 17:43:43'),(1596,'IT','Altro tipo di cache','2020-12-16 17:43:43'),(1597,'IT','Chiedere al proprietario per le condizioni di partenza','2020-12-16 17:43:43'),(1598,'IT','Adatta ai bambini','2020-12-16 17:43:43'),(1599,'IT','Ci sono ferrovie attive nelle vicinanze. Per favore usate cautela, tenendo una distanza di sicurezza e attraversando le rotaie solo ai passaggi a livello ecc.!','2020-12-16 17:43:43'),(1600,'IT','Ci sono scogliere o rocce pericolose nelle vicinanze. Fate attenzione alla caduta pietre quando siete sotto, e siate cauti quando siete sopra la scogliera - specialmente con bambini e in bicicletta. Può essere molto pericoloso prendere un sentiero ripido per salire la scogliera, poiché non potete sapere in anticipo quando la prima termina e inizia l\'altra.','2020-12-16 17:43:43'),(1601,'IT','La geocache è situata nei pressi di una area di caccia. Al crepuscolo e al buio, dovrebbe sempre essere usata una torcia portatile o frontale per ragioni di sicurezza. Incontrando i cacciatori è opportuna una reciproca gentilezza.','2020-12-16 17:43:43'),(1602,'IT','Ci sono spine nei pressi della cache. Indossare indumenti appropriati.','2020-12-16 17:43:43'),(1603,'IT','Stagionalmente ci sono molte zecche in questa area. E\' raccomandabile indossare pantaloni lunghi e ispezionarsi alla ricerca di zecche dopo il geocaching. In internet ci sono mappe di rischio per <i>encefalite e borelliosi da morso di zecca</i>, ad es. per la Germania si veda www.meningitis.de e si cerchi \"FSME\".','2020-12-16 17:43:43'),(1604,'IT','Nell\'acqua','2020-12-16 17:43:43'),(1605,'IT','Questa cache può essere trovata sia di giorno che di notte.','2020-12-16 17:43:43'),(1606,'IT','Questa cache può essere cercata solo a certe ore del giorno - vedi la descrizione per ulteriori informazioni. Per esempio, la cache può essere in un\'area soggetta ad un orario di apertura.','2020-12-16 17:43:43'),(1607,'IT','Si dovrebbe cercare questa cache solamente durante il giorno. Ad esempio, l\'area può essere pericolosa e contenere scogliere o abissi. Oppure, l\'utilizzo di torce elettriche potrebbe essere impossibile perché risulterebbe sospetto all\'interno di una zona residenziale.','2020-12-16 17:43:43'),(1608,'IT','Questa cache pu','2020-12-16 17:43:43'),(1609,'IT','Questa cache si trova tutto l\'anno, mentre la difficoltà può dipendere dalle stagioni. Specificare difficoltà per le <i>buone</i> condizioni.','2020-12-16 17:43:43'),(1610,'IT','Non cercare questa cache durante il periodo riproduttivo degli animali! Per favore indicate nella descrizione della cache quale periodo dell\'anno debba essere evitato. Prestate anche attenzione alle condizioni o ai cartelli riguardo il rispetto della natura.','2020-12-16 17:43:43'),(1611,'IT','Questa cache può essere trovata anche dopo forti nevicate. Tutte le fasi e la geocache sono nascosti in luoghi sicuri per la neve: non saranno coperti da neve caduta né da cumuli di neve creati ad esempio da veicoli spalaneve.','2020-12-16 17:43:43'),(1612,'IT','Avrete bisogno di attrezzature speciali non specificate da altri attributi, come ad esempio un puntatore laser, walkie-talkie o un cric.','2020-12-16 17:43:43'),(1613,'IT','E\' necessaria una bussola.','2020-12-16 17:43:43'),(1614,'IT','E\' necessaria una torcia portatile per trovare questa cache. Non dimenticate le batterie di riserva!','2020-12-16 17:43:43'),(1615,'IT','Per questa cache, avrete bisogno di materiale da arrampicata e di saperlo usare correttamente. Se sei un principiante, non farlo da solo, ma utilizza il sostegno di uno scalatore esperto o un alpinista.','2020-12-16 17:43:43'),(1616,'IT','Questa geocache è nascosta in una grotta, e si dovrebbe utilizzare attrezzature adeguate per accedervi. Attenzione: anche piccole grotte possono prevedere problemi imprevisti e pericoli, come in caso di temporali (acqua!) o una caviglia slogata. Consigliatevi prima con persone che abbiano esperienza di grotte! Abbiate anche cura della natura protetta, ad esempio dei luoghi dove i pipistrelli non devono essere disturbati.','2020-12-16 17:43:43'),(1617,'IT','Avrete bisogno di attrezzatura subacquea per trovare questa geocache. La profondità d\'acqua nella posizione della cache viene specificata nella descrizione. Si prega di notare che l\'immersione in tutta sicurezza richiede una formazione specifica. Senza esperienza di immersioni, è possibile cercare questa cache in compagnia di un insegnante di sub.','2020-12-16 17:43:43'),(1618,'IT','Questa cache di solito può essere trovata solo con una moto d\'acqua. Il nuoto è impossibile a causa della distanza o delle correnti. Vedi la descrizione della cache per maggiori dettagli.','2020-12-16 17:43:44'),(1619,'IT','È necessario trovare ulteriori informazioni prima di poter cercare questa cache. Ciò si applica comunemente a puzzle o mystery cache.','2020-12-16 17:43:44'),(1620,'IT','Puzzle o Mystery devono essere risolti prima o durante la ricerca di questa cache.','2020-12-16 17:43:44'),(1621,'IT','Prima o durante la ricerca di questa cache, devono essere risolti problemi matematici più difficili di semplici calcoli base.','2020-12-16 17:43:44'),(1622,'IT','Questa è una cache che non appartiene a nessuna delle categorie standard perdefinite. Usa questo attributo per cache speciali e inusuali.','2020-12-16 17:43:44'),(1623,'IT','Prima di cercare questa cache, è necessario chiedere al proprietario le condizioni di partenza. Ad esempio la cache può essere collegata ad alcuni eventi in date diverse.','2020-12-16 17:43:44'),(1624,'IT','Questa geocache è stata creata per i bambini. Tutte i compiti possono essere portati a termine da bambini tra 10 e 12 anni e il terreno non presenta rischi (come autostrade, abissi). C\'e un grande contenitore finale con oggetti di scambio e i compiti sono interessanti.','2020-12-16 17:43:44'),(1625,'IT','Questa cache vi porta in una area di miniera (abbandonata). Ci possono essere pericoli per crollo di gallerie, o potrebbe essere necessario attraversare gallerie. Fare attenzione e utilizzate attrezzature adeguate, soprattutto al buio. Le vecchie miniere possono essere oggetto di conservazione storica.','2020-12-16 17:43:44'),(1626,'IT','Ci sono piante velenose nelle vicinanze. Fate attenzione e controllate che bambini o cani non le tocchino o le ingoino.','2020-12-16 17:43:44'),(1627,'IT','Quest area è frequentata da animali potenzialmente pericolosi, ad es. volpi rabide, serpenti velenosi, scorpioni, orsi.','2020-12-16 17:43:44'),(1628,'IT','Una area di parcheggio è situata nei pressi del punto di partenza di questa cache. Se non è disponibile un parcheggio gratuito, aggiungi l\'attributo \"Tassa di ingresso o di parcheggio\"','2020-12-16 17:43:44'),(1629,'IT','Questa cache è situata al difuori di aree urbane e ha una stazione di trasporto pubblico nelle vicinanze. Non usate questo attributo per geocache in aree urbane che sono comunemente fornite di mezzi di trasporto pubblico.','2020-12-16 17:43:44'),(1630,'IT','C\'è acqua potabile lungo il percorso o nelle vicinanze della cache. Questo attributo è utile soprattutto nella pianificazione di cache evento, di lunghe escursioni o di cache in luoghi probabilmente sporchi come le grotte o le miniere.','2020-12-16 17:43:44'),(1631,'IT','Ci sono WC pubblici lungo la strada o nelle vicinanze della cache. Questo attributo è utile soprattutto per pianificare cache evento o lunghe multicache.','2020-12-16 17:43:44'),(1632,'IT','Ci sono telefoni pubblici lungo la strada o nelle vicinanze della cache. Specialmente per cache evento dovreste cercare telefoni nelle vicinanze e settare questo attributo se ce ne sono.','2020-12-16 17:43:44'),(1633,'IT','C\'è un pronto soccorso, un telefono per chiamate di soccorso, un centro di soccorso alpino o simili nelle vicinanze della cache. Questo attributo è utile soprattutto in aree difficili, come nel caso di cache con arrampicata, cache in grotte, in alta montagna o nell\'acqua. Controlla se puoi aggiungere un numero di telefono di soccorso (ad esempio del soccorso alpino) nella registrazione della tua cache.','2020-12-16 17:43:44'),(1634,'IT','La geocache è posta vicino ad un\'area di parcheggio, solo poco distante.','2020-12-16 17:43:44'),(1635,'IT','Questa cache richiede una lunga camminata - più di 5 km tra andata e ritorno. In montagna o in altre aree ripide, la distanza per una cache del genere può essere minore. Sono raccomandati scarpe da escursione ed equipaggiamento adeguato.','2020-12-16 17:43:44'),(1636,'IT','Questa cache richiede il superamento di terreno paludoso o acquitrinoso. Indossare un abbigliamento adeguato. Dopo la pioggia, il terreno può essere molto impegnativo o non praticabile a tutti.','2020-12-16 17:43:44'),(1637,'IT','Una o più salite si trovano tra voi e la cache.','2020-12-16 17:43:44'),(1638,'IT','Questa cache richiede un po\' di arrampicata e potrebbe essere necessario usare le mani, ma non c\'è bisogno di attrezzatura da arrampicata. Prestare molta attenzione durante la stagione delle piogge o prima dei temporali!','2020-12-16 17:43:44'),(1639,'IT','Questa cache richiede l\'attraversamento di un fiume o un lago. L\'acqua è abbastanza profonda per nuotare. È possibile utilizzare una barca, ma la distanza è abbastanza breve per essere alla portata di un nuotatore medio.','2020-12-16 17:43:44'),(1640,'IT','C\'è un punto di interesse alla cache, come un bel panorama o di un castello in rovina. Questo luogo merita una visita anche senza una geocache vicina.','2020-12-16 17:43:44'),(1641,'IT','Questa geocache è in muovimento. Per esempio, il proprietario potrebbe spostare regolarmente la cache da un luogo ad un altro, o i cacher potrebbero eseguire questa operazione e indicare nuove coordinate nel loro log. Il proprietario deve aggiornare le coordinate nella descrizione della cache dopo ogni mossa.','2020-12-16 17:43:44'),(1642,'IT','C\'è una webcam nella posizione di destinazione. E\' necessario registrare una foto con la webcam della vostra visita e includerla nel log. Ci possono essere requisiti addizionali come un segnale di geocaching sulla foto. L\'indirizzo della webcam è incluso nella descrizione della cache, e deve essere accessibile al pubblico, cioè non deve essere necessaria una registrazione al sito o simili.','2020-12-16 17:43:44'),(1643,'IT','Questa geocache non è nascosta all\'aria aperta ma all\'interno di un edificio, di una grotta o simili.','2020-12-16 17:43:44'),(1644,'IT','Questa cache o uno dei suoi stadi sono posizionati sott\'acqua. Devi entrare in acqua, nuotare o fare una immersione.','2020-12-16 17:43:44'),(1645,'IT','Questa cache può essere trovata senza un dispositivo GPS. Non sono utilizzate coordinate addizionali oltre alle coordinate iniziali.','2020-12-16 17:43:44'),(1646,'IT','Devi pagare un accesso o parcheggio a pagamento per accedere a questa cache, ad esempio se la cache si trova all\'interno di un parco a tema. Se ci sono alternative di parcheggio gratuiti nelle vicinanze, si prega di includerli nella descrizione. Per favore tieni presenti le nostre condizioni d\'uso a proposito di geocache commerciali.','2020-12-16 17:43:44'),(1647,'IT','Non è possibile trovare questa cache in un solo giorno o una sola notte. Dovrete visitare il percorso per più di una volta, oppure è necessario il pernottamento. Il tempo di preparazione non è incluso in questo calcolo, ma solo il tempo sul sito.','2020-12-16 17:43:44'),(1648,'IT','Una nuova notizia è stata creata su opencaching','2020-12-16 17:43:44'),(1650,'IT','La pagina invocata non esiste!','2020-12-16 17:43:44'),(1652,'IT','Redirezione - opencaching','2020-12-16 17:43:44'),(1653,'IT','Vuoi veramente cancellare la ricerca salvata?','2020-12-16 17:43:44'),(1654,'IT','Status','2020-12-16 17:43:44'),(1655,'IT','Set status','2020-12-16 17:43:44'),(1657,'IT','a','2020-12-16 17:43:44'),(1658,'IT','Percorso','2020-12-16 17:43:44'),(1659,'IT','Cache&nbsp;size:','2020-12-16 17:43:44'),(1660,'IT','Link','2020-12-16 17:43:44'),(1661,'IT','Aperto','2020-12-16 17:43:44'),(1662,'IT','Aggiungi ai favoriti...','2020-12-16 17:43:44'),(1663,'IT','Cache visualizzate:','2020-12-16 17:43:44'),(1664,'IT','Tempo di caricamento:','2020-12-16 17:43:44'),(1665,'IT','sec','2020-12-16 17:43:44'),(1666,'IT','Visualizza solo le geocache con le seguenti proprietà:','2020-12-16 17:43:44'),(1667,'IT','Tipo di cache','2020-12-16 17:43:44'),(1668,'IT','Contenitore','2020-12-16 17:43:44'),(1669,'IT','Nascosta','2020-12-16 17:43:44'),(1670,'IT','Mie','2020-12-16 17:43:44'),(1672,'IT','GC listing','2020-12-16 17:43:44'),(1673,'IT','Valutazione','2020-12-16 17:43:44'),(1674,'IT','Raccomandazioni min.:','2020-12-16 17:43:44'),(1678,'IT','Inserire un testo da cercare!','2020-12-16 17:43:44'),(1680,'IT','Waypoint %1 non trovato!','2020-12-16 17:43:44'),(1681,'IT','D/T:','2020-12-16 17:43:45'),(1683,'IT','Errore: Impossibile scaricare i risultati della ricerca (codice di errore HTTP %1)','2020-12-16 17:43:45'),(1684,'IT','Errore: Impossibile scaricare i risultati della ricerca. I dati non sono disponibili sul server.','2020-12-16 17:43:45'),(1685,'IT','Sono state trovate %1 geocache nella regione selezionata che soddisfano le condizioni di filtro. Zoomare per visualizzare le cache.','2020-12-16 17:43:45'),(1687,'IT','Crea un log','2020-12-16 17:43:45'),(1688,'IT','Edita il log','2020-12-16 17:43:45'),(1689,'IT','Rimuovi il log','2020-12-16 17:43:45'),(1690,'IT','Edita la cache','2020-12-16 17:43:45'),(1691,'IT','Aggiungi descrizione','2020-12-16 17:43:45'),(1692,'IT','Edita descrizione','2020-12-16 17:43:45'),(1693,'IT','Rimuovi descrizione','2020-12-16 17:43:45'),(1694,'IT','Seleziona città','2020-12-16 17:43:45'),(1695,'IT','Visualizza risultati ricerca','2020-12-16 17:43:45'),(1696,'IT','Risultati','2020-12-16 17:43:45'),(1697,'IT','Descrizione - Creare una cache','2020-12-16 17:43:45'),(1698,'IT','Aggiungi immagine','2020-12-16 17:43:45'),(1699,'IT','Messaggio','2020-12-16 17:43:45'),(1700,'IT','Non ci sono chiavi google maps registrate per questo dominio.','2020-12-16 17:43:45'),(1701,'IT','Attenzione! Questa geocache è &quot;<span class=\"errormsg\">%1</span>&quot;!</strong> Non c\'è un contenitore fisico alle coordinate specificate (o a quelle che devono essere determinate). L\'interesse del luogo non è necessariamente la ricercare!','2020-12-16 17:43:45'),(1702,'IT','Attenzione! Questa geocache è &quot;<span class=\"errormsg\">%1</span>&quot;!</strong> La geocache stessa o sue parti sono mancanti o ci sono altri problemi che rendono impossibile cercarla con successo. L\'interesse del luogo non è necessariamente la ricercare!','2020-12-16 17:43:45'),(1703,'IT','Hai partecipato a questo evento!','2020-12-16 17:43:45'),(1704,'IT','Hai già trovato questa cache','2020-12-16 17:43:45'),(1705,'IT','<i>Obsoleto: Questo attributo non può essere assegnato a nuove cache, perché non è conforme nelle attuali condizioni d\'uso.</i><br /> Questa cache è disponibile non solo su Opencaching, ma anche in altri siti di geocaching. Questo vale per le cache che sono state collegate dai loro proprietari a corrispondenti annunci in altri siti. Si prega di notare che le descrizioni e lo stato di una cache elencata in più di un sito devono essere mantenute uguali in tutti i siti compreso Opencaching, secondo le nostre condizioni d\'uso. ','2020-12-16 17:43:45'),(1706,'IT','Questo nodo OC','2020-12-16 17:43:45'),(1707,'IT','Altri nodi OC','2020-12-16 17:43:45'),(1708,'IT','I prossimi eventi in %1','2020-12-16 17:43:45'),(1709,'IT','Geocaches with most recommendations in the last %2 days in %1.','2020-12-16 17:43:45'),(1710,'IT','Ultime cache in %1','2020-12-16 17:43:45'),(1711,'IT','You need %1 more found log(s) to make another recommendation.','2020-12-16 17:43:45'),(1713,'IT','Hai raccomandato questa cache.','2020-12-16 17:43:45'),(1714,'IT','Ritira la raccomandazione','2020-12-16 17:43:45'),(1717,'IT','Per favore seleziona!','2020-12-16 17:43:45'),(1718,'IT','Risultati su questa pagina','2020-12-16 17:43:45'),(1722,'IT','Vuoi veramente cancellare?','2020-12-16 17:43:45'),(1723,'IT','Vuoi veramente rimuovere questa raccomandazione?','2020-12-16 17:43:45'),(1724,'IT','Route:','2020-12-16 17:43:45'),(1725,'IT','Scarica come...','2020-12-16 17:43:45'),(1726,'IT','Remove log entry for <a href=\"viewcache.php?cacheid={cacheid}\">{cachename}</a>','2020-12-16 17:43:45'),(1727,'IT','Aggiungi una nuova descrizione della cache a <a href=\"viewcache.php?cacheid={cacheid}\">{name}</a>','2020-12-16 17:43:45'),(1728,'IT','Invia al dispositivo GPS','2020-12-16 17:43:45'),(1729,'IT','Storia Geoketry','2020-12-16 17:43:45'),(1730,'IT','Nuovo argomento per il forum (%1)','2020-12-16 17:43:45'),(1731,'IT','Team blog','2020-12-16 17:43:45'),(1732,'IT','Forum','2020-12-16 17:43:45'),(1733,'IT','Geoketry','2020-12-16 17:43:45'),(1735,'IT','For Event Caches: The date of event!','2020-12-16 17:43:45'),(1736,'IT','Identificativo utente:','2020-12-16 17:43:45'),(1737,'IT','List','2020-12-16 17:43:45'),(1738,'IT','Data evento:','2020-12-16 17:43:45'),(1739,'IT','Found: %1   Hidden: %2','2020-12-16 17:43:45'),(1740,'IT','<Unknown user>','20