,'2020-12-16 17:43:43'),(1600,'NL','Er zijn rotsen of gevaarlijke rotsen in de buurt. Pas op voor vallende stenen aan de onderkant, en wees voorzichtig aan de bovenzijde van de kliffen vooral met kinderen of mountainbikes. Het kan erg gevaarlijk zijn als er een afdaling is en zeker wanneer er niet op tijd een afgrond zichtbaar is.','2020-12-16 17:43:43'),(1601,'NL','De cache is geplaatst in jachtgebied. In schemering of nacht is een zaklamp of hoofdlamp noodzakelijk voor de veiligheid. Wees er van bewust dan men jagers tegen kan komen.','2020-12-16 17:43:43'),(1602,'NL','In de nabijheid van de cache bevinden zich doornen. Draag beschermende kleding en eventueel handschoenen.','2020-12-16 17:43:43'),(1603,'NL','In bepaald seizoenen komen teken voor in dit gebied. Het wordt aanbevolen lange kleding te dragen en na het cachen de lichamen te controleren op teken. Er zijn risico kaarten <i>tick-borne encephalitis</i> op het internet te vinden. Voor Duitsland op www.meningitis.de (zoek op FSME).','2020-12-16 17:43:43'),(1604,'NL','In het water','2020-12-16 17:43:43'),(1605,'NL','Deze cache is de doen bij dag en nacht, en alle weekdagen.','2020-12-16 17:43:43'),(1613,'NL','Een kompas is noodzakelijk.','2020-12-16 17:43:43'),(1614,'NL','Een zaklamp is noodzakelijk om deze cache te vinden. Denk ook aan reserve batterijen!','2020-12-16 17:43:43'),(1615,'NL','Voor deze cache is een klim uitrusting nodig en de benodigde kennis om te klimmen. Indien men geen ervaring heeft is het raadzaam om niet alleen te gaan, maar hulp te vragen aan iemand met klimervaring.','2020-12-16 17:43:43'),(1616,'NL','Deze cache is geplaatst in een grot, en het is raadzaam om de benodigde zaken mee te nemen. Pas op: Zelfs de klein grotten kunnen gevaren met zich meebrengen zoals bij hevige regenval buiten zou het water de grot in kunnen stromen of men kan gewond raken. Vraag eventueel aan een deskundige om advies. Denk ook aan de natuur, zoals beschermde dieren (vleermuizen) en mogen dan ook niet verstoord worden. ','2020-12-16 17:43:43'),(1617,'NL','Om deze cache te vinden heeft men een duikuitrusting nodig. Op welke diepte de cache ligt staat beschreven in de beschrijving. Denk er wel aan dat duiken niet zonder ervaring gedaan kan worden, of ga als groep of met een instructeur zoeken.','2020-12-16 17:43:43'),(1618,'NL','Deze cache kan alleen gevonden worden met behulp van een boot. Door de afstand is het niet mogelijk om de cache zwemmend te benaderen. Zie de cachebeschrijving voor meer gegevens.','2020-12-16 17:43:43'),(1619,'NL','Voor deze cache moet er informatie opgezocht worden voor het zoeken van de cache. Dit komt vaak voor bij puzzel/mysterie caches.','2020-12-16 17:43:44'),(1620,'NL','Bij deze cache moet voor of onderweg een puzzel opgelost worden om de cache te zoeken.','2020-12-16 17:43:44'),(1621,'NL','Er moeten voor of tijdens het cachen rekenopgaven gedaan worden die verder gaan dan het simpele rekenwerk. Bijvoorbeeld middelpuntberekeningen of peilingen.','2020-12-16 17:43:44'),(1642,'NL','Aan het einde is een webcam en om te loggen dient een opname uit die webcam waar men dan op staat te krijgen om te bewijzen dat men daar daadwerkelijk was. Sommige webcam-caches vragen wat extra\'s zoals een banner te tonen. Het webadres dient aangegeven te worden in de beschrijving, en dient vrij toegankelijk te zijn, zonder een account te hoeven maken en vrij van kosten.','2020-12-16 17:43:44'),(1643,'NL','Deze cache in niet geplaatst in open gebied, maar in een gebouw, een grot of iets dergelijks.','2020-12-16 17:43:44'),(1644,'NL','Deze cache of één van de punten is geplaatst onder water. Men dient in het water te gaan, te zwemmen of te duiken.','2020-12-16 17:43:44'),(1645,'NL','Deze cache kan gevonden worden zonder GPS. Behalve de startcoördinaten heeft men geen andere coördinaten nodig om de cache te zoeken.','2020-12-16 17:43:44'),(1646,'NL','Er dient parkeergeld en/of entree betaald te worden om deze cache te doen, bijvoorbeeld in een themapark. Als er een alternatie gratis parkeerplaats in de buurt is dient dat ook in de cachebeschrijving vermeld te worden. Let op onze huidige voorwaarden voor het gebruik met betrekking tot \"commerciële caches\".','2020-12-16 17:43:44'),(1647,'NL','Deze cache kan niet in één dag of nacht gedaan worden. De locatie zal verschillende keren bezocht moeten worden of moeten overnachten. Voorbereidingstijd is niet berekend, alleen de tijd tijdens het cachen.','2020-12-16 17:43:44'),(1648,'NL','Een nieuwsbericht is gemaakt op opencaching','2020-12-16 17:43:44'),(1650,'NL','De opgevraagde pagina bestaat niet!','2020-12-16 17:43:44'),(1652,'NL','Redirect - opencaching','2020-12-16 17:43:44'),(1653,'NL','Moet de opgeslagen zoek resultaten verwijdert worden?','2020-12-16 17:43:44'),(1654,'NL','Status','2020-12-16 17:43:44'),(1655,'NL','Set status','2020-12-16 17:43:44'),(1657,'NL','tot','2020-12-16 17:43:44'),(1658,'NL','Route','2020-12-16 17:43:44'),(1659,'NL','Cachegrootte:','2020-12-16 17:43:44'),(1660,'NL','Link','2020-12-16 17:43:44'),(1661,'NL','Openen','2020-12-16 17:43:44'),(1662,'NL','Aan favorieten toevoegen','2020-12-16 17:43:44'),(1663,'NL','Getoonde caches:','2020-12-16 17:43:44'),(1664,'NL','Laadtijd:','2020-12-16 17:43:44'),(1665,'NL','sec.','2020-12-16 17:43:44'),(1666,'NL','Alleen caches met de volgende eigenschappen tonen:','2020-12-16 17:43:44'),(1667,'NL','Cache soort','2020-12-16 17:43:44'),(1668,'NL','Cache behuizing','2020-12-16 17:43:44'),(1669,'NL','Verbergen','2020-12-16 17:43:44'),(1670,'NL','Mijn eigen','2020-12-16 17:43:44'),(1673,'NL','Waardering','2020-12-16 17:43:44'),(1674,'NL','Min. aanbevelingen:','2020-12-16 17:43:44'),(1678,'NL','Voer een zoektekst in, alstublieft!','2020-12-16 17:43:44'),(1680,'NL','Waypoint %1 niet gevonden!','2020-12-16 17:43:44'),(1681,'NL','M/T:','2020-12-16 17:43:45'),(1683,'NL','Fout: Het zoek resultaat kan niet weergegeven worden (HTTP fout code %1)','2020-12-16 17:43:45'),(1684,'NL','Fout: Het zoek resultaat kan niet weergegeve