nkomstige vermeldingen op andere sites. Wij wijzen er op, dat ook op opencaching de veranderingen die de cache ondergaat vermeld dienen te worden zoals ook omschreven wordt in de gebruikersverklaring.','2020-12-16 17:43:45'),(1706,'NL','Deze OC-site','2020-12-16 17:43:45'),(1707,'NL','Andere OC-sites','2020-12-16 17:43:45'),(1708,'NL','De volgende evenementen in %1','2020-12-16 17:43:45'),(1709,'NL','Geocaches with most recommendations in the last %2 days in %1.','2020-12-16 17:43:45'),(1710,'NL','Nieuwste caches in %1','2020-12-16 17:43:45'),(1711,'NL','You need %1 more found log(s) to make another recommendation.','2020-12-16 17:43:45'),(1713,'NL','Je hebt deze cache aanbevolen.','2020-12-16 17:43:45'),(1714,'NL','Aanbeveling terugtrekken','2020-12-16 17:43:45'),(1717,'NL','Alstublieft kiezen!','2020-12-16 17:43:45'),(1718,'NL','Resultaat op deze pagina','2020-12-16 17:43:45'),(1722,'NL','Moet deze log werkelijk verwijderd worden?','2020-12-16 17:43:45'),(1723,'NL','Moet deze aanbeveling werkelijk verwijderd worden?','2020-12-16 17:43:45'),(1724,'NL','Route:','2020-12-16 17:43:45'),(1725,'NL','Download als ...','2020-12-16 17:43:45'),(1726,'NL','Log voor <a href=\"viewcache.php?cacheid={cacheid}\">{cachename}</a> verwijderen','2020-12-16 17:43:45'),(1727,'NL','Nieuwe beschrijving voor <a href=\"viewcache.php?cacheid={cacheid}\">{name}</a> toevoegen','2020-12-16 17:43:45'),(1728,'NL','Verstuur naar GPS','2020-12-16 17:43:45'),(1729,'NL','Geokrety verleden','2020-12-16 17:43:45'),(1730,'NL','Nieuw forum topic(s) (%1)','2020-12-16 17:43:45'),(1758,'NL','Het account is al geactiveerd. Probeer <a href=\"login.php\">inloggen</a>.<br /> Indien je niet in kunt loggen. lees dan de volgende pagina: <a href=\"%1\">Problemen met inloggen</a>','2020-12-16 17:43:46'),(2237,'NL','Caches:','2020-12-16 17:43:52'),(2244,'NL','Waypoint:','2020-12-16 17:43:52'),(2246,'NL','<span></span>','2020-12-16 17:43:52'),(2247,'NL','Gebruiker:','2020-12-16 17:43:52'),(2522,'NL','OConly','2020-1