итайте <a href=\"articles.php?page=cacheinfo\">описание</a> отдельных полей.','2020-12-16 17:43:40'),(1423,'RU','Описание:','2020-12-16 17:43:41'),(1490,'RU','Пароль','2020-12-16 17:43:41'),(1524,'RU','Тип','2020-12-16 17:43:42'),(1538,'RU','Язык:','2020-12-16 17:43:42'),(1541,'RU','Ночной','2020-12-16 17:43:42'),(1544,'RU','Опасная зона','2020-12-16 17:43:42'),(1550,'RU','Железная дорога','2020-12-16 17:43:42'),(1552,'RU','Охота','2020-12-16 17:43:42'),(1553,'RU','Колючки','2020-12-16 17:43:42'),(1554,'RU','Клещи','2020-12-16 17:43:42'),(1555,'RU','Заброшенные шахты','2020-12-16 17:43:42'),(1556,'RU','Ядовитые растения','2020-12-16 17:43:42'),(1557,'RU','Опасные животные','2020-12-16 17:43:42'),(1558,'RU','Парковка','2020-12-16 17:43:42'),(1559,'RU','Общественный транспорт','2020-12-16 17:43:42'),(1560,'RU','Питьевая вода','2020-12-16 17:43:42'),(1561,'RU','Туалет','2020-12-16 17:43:42'),(1562,'RU','Телефон','2020-12-16 17:43:43'),(1563,'RU','Первая помощь','2020-12-16 17:43:43'),(1566,'RU','Болото','2020-12-16 17:43:43'),(1567,'RU','Холмистая местность','2020-12-16 17:43:43'),(1576,'RU','Плата за вход или парковку','2020-12-16 17:43:43'),(1578,'RU','Круглосуточный','2020-12-16 17:43:43'),(1580,'RU','Дневной','2020-12-16 17:43:43'),(1582,'RU','Всесезонный','2020-12-16 17:43:43'),(1586,'RU','Компас','2020-12-16 17:43:43'),(1587,'RU','Фонарь','2020-12-16 17:43:43'),(1588,'RU','Альпинистское снаряжение','2020-12-16 17:43:43'),(1589,'RU','Пещерное снаряжение','2020-12-16 17:43:43'),(1591,'RU','Плавсредство','2020-12-16 17:43:43'),(1594,'RU','Головоломка','2020-12-16 17:43:43'),(1595,'RU','Математическая задача','2020-12-16 17:43:43'),(1598,'RU','Детский','2020-12-16 17:43:43'),(1599,'RU','Действующая железная дорога неподалёку. Будьте осторожны, держитесь на безопасной дистанции, будьте внимательны при переходе.','2020-12-16 17:43:43'),(1601,'RU','Тайник спрятан в охотничьих угодьях. Опасайтесь попасть под выстрел. В сумерках или темноте держите фонарь вклёченным в целях безопасности. ','2020-12-16 17:43:43'),(1602,'RU','Опасайтесь колючек. Носите подходящую одежду.','2020-12-16 17:43:43'),(1603,'RU','В летнее время опасайтесь клещей. Носите брюки, одежду с длинными рукавами, периодически осматривайте друг друга. Заранее позаботьтесь о прививках против клещевого энцефалита.','2020-12-16 17:43:43'),(1605,'RU','Этот тайник можно искать хоть днём, хоть ночью.','2020-12-16 17:43:43'),(1607,'RU','Этот тайник можно искать только в светлое время суток. Например, скалистая местность с утёсами и обрывами опасна для посещения ночью, а в жилой местности использование фонарей может выглядеть подозрительно.','2020-12-16 17:43:43'),(1609,'RU','Тайник можно искать круглый год, но сложность может зависетьот сезона. Указывайте сложность для хороших условий.','2020-12-16 17:43:43'),(1613,'RU','Для поисков нужен компас.','2020-12-16 17:43:43'),(1614,'RU','Для поисков необходим фонарь. Не забудьте запасной комплект батарей!','2020-12-16 17:43:43'),(1615,'RU','Для поисков этого тайника вам потребуется альпинистское снаряжения и навыки его правильного использования. Если вы новичок, не ходите на поиски в одиночку, возьмите с собой опытного альпиниста.','2020-12-16 17:43:43'),(1616,'RU','Этот тайник спрятан в пещере, и вам потребуется соответствующее снаряжение. Будьте осторожны, даже маленькие пещеры могут быть таить непредвиденные опасности, такие, как внезапная гроза (берегитесь воды) или вывихнутая лодыжка. Посоветуйтесь с опытными людьми прежде чем лезть в пещеру. Также берегите природу, например, не тревожьте летучих мышей.','2020-12-16 17:43:43'),(1618,'RU','Тайник может быть найден только с использованием плавредства: лодки, катера, яхты… Добраться до тайника вплавь (без лодки) не представляется возможным из-за расстояния, течения или иных препятствий. Подробности должны быть указаны в описании.','2020-12-16 17:43:44'),(1621,'RU','Перед или во время поисков тайника нужно рещить математическую задачу, выходящую за рамки тривиальных арифметических операций.','2020-12-16 17:43:44'),(1624,'RU','Тайник сделан специально для детей. TODO. ','2020-12-16 17:43:44'),(1626,'RU','Опасайтесь ядовитых растений. Смотрите за детьми и собаками, не давайте им трогать или есть отраву.','2020-12-16 17:43:44'),(1627,'RU','Эта местность населена потенциально опасными животными, например, медведями, ядовитыми змеями, скорпионами, или является природным очагом бешенства.','2020-12-16 17:43:44'),(1628,'RU','Ближняя парковка является хорошей начальной точкой для поисков тайника. Если поблизости нет бесплатных парковок, должен быть установлен атрибут «Плата за вход или парковку».','2020-12-16 17:43:44'),(1629,'RU','Тайник расположен за городом, но до него можно добраться общественным транспортом. Не устанавливайте этот атрибут для тайников в населённых пунктах.','2020-12-16 17:43:44'),(1630,'RU','По пути к тайнику или поблизости от тайника есть источник питьевой воды. Этот атрибут полезен для планирования встреч, длительных пеших прогулок или посещения тайников в потенциально грязных местах, таких, как пещеры.','2020-12-16 17:43:44'),(1636,'RU','При поисках этого тайника придётся ходить по болоту или преодолевать залитые водой участки местности. Носите подходящую одежду и обувь. После ливня местность может стать непроходимой.','2020-12-16 17:43:44'),(1658,'RU','Путь','2020-12-16 17:43:44'),(1659,'RU','Размер контейнера','2020-12-16 17:43:44'),(1710,'RU','Новые тайники в %1','2020-12-16 17:43:45'),(2237,'RU','Тайники:','2020-12-16 17:43:52'),(2246,'RU','<span></span>','2020-12-16 17:43:52'),(922,'SV','SV','2011-05-15 11:46:05');
